import java.util.*;

public class Solution {
    public int reachableNodes(int[][] edges, int maxMoves, int n) {
        List<int[]>[] graph = new ArrayList[n];
        for (int i = 0; i < n; i++) {
            graph[i] = new ArrayList<>();
        }

        // Build graph
        for (int[] edge : edges) {
            int u = edge[0], v = edge[1], w = edge[2];
            graph[u].add(new int[]{v, w + 1});
            graph[v].add(new int[]{u, w + 1});
        }

        // Do dijkstra
        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> a[0] - b[0]);
        pq.offer(new int[] {0, 0}); // (distance, node)
        int[] dist = new int[n];
        Arrays.fill(dist, Integer.MAX_VALUE);
        dist[0] = 0;

        while (!pq.isEmpty()) {
            int[] curr = pq.poll();
            if (curr[0] > dist[curr[1]]) continue;

            for (int[] next : graph[curr[1]]) {
                int newDist = curr[0] + next[1];
                if (newDist < dist[next[0]]) {
                    dist[next[0]] = newDist;
                    pq.offer(new int[] {newDist, next[0]});
                }
            }
        }

        // Count reachable nodes
        int count = 0;
        for (int d : dist) {
            if (d <= maxMoves) count++;
        }

        // Add nodes that can be extended from (u, v) in at most maxMoves steps
        for (int[] edge : edges) {
            int u = edge[0], v = edge[1], w = edge[2];
            int l = Math.max(0, maxMoves - dist[u]);
            int r = Math.max(0, maxMoves - dist[v]);
            count += Math.min(l + r, w);
        }

        return count;
    }
}

