    private boolean isMagicSquare(int[][] grid, int row, int col) {
        Set<Integer> set = new HashSet<>();
        for (int i = 0; i < 3; i++) {
            for (int j = 0; j < 3; j++) {
                if (grid[row + i][col + j] < 1 || grid[row + i][col + j] > 9) {
                    return false;
                }
                set.add(grid[row + i][col + j]);
            }
