public class Solution {
    public int[][] flipAndInvertImage(int[][] image) {
        for (int[] row : image) {
            // Reverse the row
            int left = 0;
            int right = row.length - 1;
            while (left < right) {
                int temp = row[left];
                row[left] = row[right];
                row[right] = temp;
                left++;
                right--;
            }

            // Invert the row
            for (int i = 0; i < row.length; i++) {
                row[i] = row[i] == 1 ? 0 : 1;
            }
        }
        return image;
    }
}

