import java.util.HashMap;
public class Solution {
    public int largestIsland(int[][] grid) {
        if (grid == null || grid.length == 0) return 0;

        int n = grid.length;
        HashMap<Integer, Integer> sizeMap = new HashMap<>();
        int index = 2; // start from 2 because we use 1 for island and 0 for water
        int maxSize = 0;

        // mark each island with a unique number and calculate its size
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 1) {
                    int size = dfs(grid, i, j, index);
                    sizeMap.put(index, size);
                    maxSize = Math.max(maxSize, size);
                    index++;
                }
            }
        }

        // try to change each water cell to land and calculate the new island size
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 0) {
                    int newSize = 1;
                    boolean[] seen = new boolean[index];
                    for (int[] dir : new int[][]{{-1, 0}, {1, 0}, {0, -1}, {0, 1}}) {
                        int x = i + dir[0], y = j + dir[1];
                        if (x >= 0 && x < n && y >= 0 && y < n && grid[x][y] > 1 && !seen[grid[x][y]]) {
                            newSize += sizeMap.get(grid[x][y]);
                            seen[grid[x][y]] = true;
                        }
                    }
                    maxSize = Math.max(maxSize, newSize);
                }
            }
        }

        return maxSize;
    }

    private int dfs(int[][] grid, int i, int j, int index) {
        if (i < 0 || i >= grid.length || j < 0 || j >= grid[0].length || grid[i][j] != 1) return 0;

        grid[i][j] = index;
        int size = 1;
        for (int[] dir : new int[][]{{-1, 0}, {1, 0}, {0, -1}, {0, 1}}) {
            size += dfs(grid, i + dir[0], j + dir[1], index);
        }
        return size;
    }
}

