public class Solution {
    private static final int MOD = (int) 1e9 + 7;

    public int nthMagicalNumber(int n, int a, int b) {
        long left = Math.min(a, b);
        long right = (long) n * Math.min(a, b);

        while (left < right) {
            long mid = left + (right - left) / 2;

            if (mid / a + mid / b < n) {
                left = mid + 1;
            } else {
                right = mid;
            }
        }

        return (int) (left % MOD);
    }
