public class Solution {
    private static final int MOD = (int) 1e9 + 7;

    public int profitableSchemes(int n, int minProfit, int[] group, int[] profit) {
        int[][][] dp = new int[profit.length + 1][n + 1][minProfit + 1];

        // Initialize the base case where no crimes are committed
        for (int i = 0; i <= n; i++) {
            dp[0][i][0] = 1;
        }

        for (int i = 1; i <= profit.length; i++) {
            int members = group[i - 1];
            int currentProfit = profit[i - 1];

            for (int j = 0; j <= n; j++) {
                for (int k = 0; k <= minProfit; k++) {
                    // If the current crime requires more members than available, skip it
                    if (j < members) {
                        dp[i][j][k] = dp[i - 1][j][k];
                    } else {
                        // Calculate the number of schemes with and without the current crime
                        int withoutCurrentCrime = dp[i - 1][j][k];
                        int withCurrentCrime = (k >= currentProfit) ? dp[i - 1][j - members][k - currentProfit] : 0;

                        dp[i][j][k] = (withoutCurrentCrime + withCurrentCrime) % MOD;
                    }
                }
            }
        }

        // Calculate the total number of schemes that meet the minimum profit requirement
        int result = 0;
        for (int i = minProfit; i <= minProfit; i++) {
            result = (result + dp[profit.length][n][i]) % MOD;
        }

        return result;
    }
}

