public class Solution {
    public String maskPII(String s) {
        if (s.contains("@")) {
            return maskEmail(s);
        } else {
            return maskPhoneNumber(s);
        }
    }

    private String maskEmail(String email) {
        int atIndex = email.indexOf('@');
        String localName = email.substring(0, atIndex);
        String domain = email.substring(atIndex + 1);

        StringBuilder maskedLocalName = new StringBuilder();
        maskedLocalName.append(Character.toLowerCase(localName.charAt(0)));
        for (int i = 1; i < localName.length() - 1; i++) {
            maskedLocalName.append('*');
        }
        maskedLocalName.append(Character.toLowerCase(localName.charAt(localName.length() - 1)));

        StringBuilder maskedDomain = new StringBuilder();
        for (char c : domain.toCharArray()) {
            if (Character.isUpperCase(c)) {
                maskedDomain.append(Character.toLowerCase(c));
            } else {
                maskedDomain.append(c);
            }
        }

        return maskedLocalName.toString() + "@" + maskedDomain.toString();
    }

    private String maskPhoneNumber(String phoneNumber) {
        StringBuilder digits = new StringBuilder();
        for (char c : phoneNumber.toCharArray()) {
            if (Character.isDigit(c)) {
                digits.append(c);
            }
        }

        int countryCodeLength = digits.length() - 10;
        StringBuilder maskedPhoneNumber = new StringBuilder();

        switch (countryCodeLength) {
            case 0:
                maskedPhoneNumber.append("("***");
                break;
            case 1:
                maskedPhoneNumber.append("+").append("-").append(digits.charAt(0)).append("-***");
                break;
            case 2:
                maskedPhoneNumber.append("+").append(digits.substring(0, 2)).append("-***");
                break;
            default:
                maskedPhoneNumber.append("+").append("***-").append(digits.substring(0, countryCodeLength)).append("-***");
        }

        maskedPhoneNumber.append(digits.substring(Math.max(0, digits.length() - 4)));

        return maskedPhoneNumber.toString();
    }
}

