public class Solution {
    public int maxDistToClosest(int[] seats) {
        int n = seats.length;
        int left = -1, right = -1;

        // Find the first person from the left
        for (int i = 0; i < n; i++) {
            if (seats[i] == 1) {
                left = i;
                break;
            }
        }

        // Find the last person from the right
        for (int i = n - 1; i >= 0; i--) {
            if (seats[i] == 1) {
                right = i;
                break;
            }
        }

        int maxDist = Math.max(left, n - 1 - right);

        // Find the maximum distance between two people
        for (int i = left + 1; i < right; i++) {
            if (seats[i] == 0) {
                int dist = Integer.MAX_VALUE;
                int j = i;
                while (j >= 0 && seats[j] != 1) {
                    j--;
                }
                if (j >= 0) {
                    dist = Math.min(dist, i - j);
                }
                j = i;
                while (j < n && seats[j] != 1) {
                    j++;
                }
                if (j < n) {
                    dist = Math.min(dist, j - i);
                }
                maxDist = Math.max(maxDist, dist);
            }
        }

        return maxDist;
    }
}

