public class Solution {
    public double new21Game(int n, int k, int maxPts) {
        if (k == 0 || n >= k + maxPts) return 1.0;

        double[] dp = new double[n + 1];
        dp[k] = 1.0;

        double sum = 1.0;

        for (int i = k + 1; i <= n; i++) {
            dp[i] = sum / maxPts;
            sum -= (i - maxPts >= k ? dp[i - maxPts] : 0);
        }

        return sum;
    }
}

