public class Solution {
    public int[] hitBricks(int[][] grid, int[][] hits) {
        int m = grid.length;
        int n = grid[0].length;
        int[] result = new int[hits.length];

        // Mark the bricks that are going to be erased
        for (int i = 0; i < hits.length; i++) {
            int x = hits[i][0];
            int y = hits[i][1];
            if (grid[x][y] == 1) {
                grid[x][y] = -1;
            }
        }

        // Check which bricks are stable
        for (int i = 0; i < n; i++) {
            dfs(grid, 0, i);
        }

        int index = hits.length - 1;
        while (index >= 0) {
            int x = hits[index][0];
            int y = hits[index][1];

            if (grid[x][y] == -1) {
                grid[x][y] = 1;

                // Check how many bricks are stable after adding the brick back
                result[index] = dfs(grid, x, y) - 1;

                // If no bricks were added, reset the cell to -1
                if (result[index] == -1) {
                    grid[x][y] = -1;
                }
            }

            index--;
        }

        return result;
    }

    private int dfs(int[][] grid, int x, int y) {
        if (x < 0 || x >= grid.length || y < 0 || y >= grid[0].length || grid[x][y] != 1) {
            return 0;
        }

        grid[x][y] = -2; // Mark the brick as visited

        int count = 1;

        if (x == 0) { // If it's connected to the top, mark all adjacent bricks
            dfs(grid, x + 1, y);
        } else {
            count += dfs(grid, x - 1, y); // Check the brick above
            count += dfs(grid, x + 1, y); // Check the brick below
            count += dfs(grid, x, y - 1); // Check the brick to the left
            count += dfs(grid, x, y + 1); // Check the brick to the right
        }

        return count;
    }
}

