public class Solution {
    public int surfaceArea(int[][] grid) {
        int n = grid.length;
        int area = 0;

        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] > 0) {
                    // Add the top and bottom faces
                    area += 2;

                    // Add the side faces
                    area += grid[i][j] * 4;

                    // Subtract the faces that are adjacent to other cubes
                    if (i > 0) {
                        area -= Math.min(grid[i][j], grid[i - 1][j]);
                    }
                    if (i < n - 1) {
                        area -= Math.min(grid[i][j], grid[i + 1][j]);
                    }
                    if (j > 0) {
                        area -= Math.min(grid[i][j], grid[i][j - 1]);
                    }
                    if (j < n - 1) {
                        area -= Math.min(grid[i][j], grid[i][j + 1]);
                    }
                }
            }
        }

        return area;
    }
}

