public class Solution {
    public String pushDominoes(String dominoes) {
        char[] res = new char[dominoes.length()];
        int n = dominoes.length();

        // Initialize the result array with '.'
        for (int i = 0; i < n; i++) {
            res[i] = '.';
        }

        // Find all 'L' and 'R' in the string
        int[] forces = new int[n];
        int force = 0;
        for (int i = 0; i < n; i++) {
            if (dominoes.charAt(i) == 'R') {
                force = n;
            } else if (dominoes.charAt(i) == 'L') {
                force = -n;
            }
            forces[i] += force;
            force = Math.max(force - 1, 0);
        }

        // Find all 'L' and 'R' in the string from right to left
        for (int i = n - 1; i >= 0; i--) {
            if (dominoes.charAt(i) == 'L') {
                force = n;
            } else if (dominoes.charAt(i) == 'R') {
                force = -n;
            }
            forces[i] += force;
            force = Math.max(force - 1, 0);
        }

        // Determine the final state of each domino
        for (int i = 0; i < n; i++) {
            if (forces[i] > 0) {
                res[i] = 'R';
            } else if (forces[i] < 0) {
                res[i] = 'L';
            }
        }

        return new String(res);
    }
}

