import com_github_leetcode.TreeNode;

public class Solution {
    private int maxDepth;
    private TreeNode result;

    public TreeNode subtreeWithAllDeepest(TreeNode root) {
        maxDepth = -1;
        dfs(root, 0);
        return result;
    }

    private int dfs(TreeNode node, int depth) {
        if (node == null) {
            return depth - 1;
        }
        maxDepth = Math.max(maxDepth, depth);
        int leftDepth = dfs(node.left, depth + 1);
        int rightDepth = dfs(node.right, depth + 1);

        if (leftDepth == maxDepth && rightDepth == maxDepth) {
            result = node;
        } else if (leftDepth == maxDepth) {
            result = subtreeWithAllDeepest(node.left);
        } else if (rightDepth == maxDepth) {
            result = subtreeWithAllDeepest(node.right);
        }
        return Math.max(leftDepth, rightDepth);
    }
}

