            if (i < stations.length && stations[i][0] <= curr) {
                pq.offer(stations[i][1]);
                i++;
            } else if (!pq.isEmpty()) {
                curr += pq.poll();
                res++;
            } else {
                return -1;
            }
        }

        return res;
    }
}

