import java.util.*;

public class Solution {
    public boolean possibleBipartition(int n, int[][] dislikes) {
        // Create an adjacency list to represent the graph
        List<Integer>[] graph = new ArrayList[n + 1];
        for (int i = 0; i <= n; i++) {
            graph[i] = new ArrayList<>();
        }

        // Build the graph based on the dislikes array
        for (int[] dislike : dislikes) {
            int personA = dislike[0];
            int personB = dislike[1];
            graph[personA].add(personB);
            graph[personB].add(personA);
        }

        // Initialize an array to keep track of the color of each node
        int[] colors = new int[n + 1];

        // Iterate over all nodes and perform DFS if a node is not colored yet
        for (int i = 1; i <= n; i++) {
            if (colors[i] == 0 && !dfs(graph, colors, i, 1)) {
                return false;
            }
        }

        return true;
    }

    // Helper function to perform DFS and color the nodes
    private boolean dfs(List<Integer>[] graph, int[] colors, int node, int color) {
        if (colors[node] != 0) {
            return colors[node] == color;
        }

        colors[node] = color;

        for (int neighbor : graph[node]) {
            if (!dfs(graph, colors, neighbor, -color)) {
                return false;
            }
        }

        return true;
    }
}

