public class Solution {
    public int projectionArea(int[][] grid) {
        int n = grid.length;
        int xyProjection = 0, yzProjection = 0, zxProjection = 0;

        // Calculate the xy-projection area
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] > 0) {
                    xyProjection++;
                }
            }
        }

        // Calculate the yz-projection area
        int[] maxInRow = new int[n];
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                maxInRow[i] = Math.max(maxInRow[i], grid[i][j]);
            }
        }
        yzProjection = sumOfArray(maxInRow);

        // Calculate the zx-projection area
        int[] maxInCol = new int[n];
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                maxInCol[j] = Math.max(maxInCol[j], grid[i][j]);
            }
        }
        zxProjection = sumOfArray(maxInCol);

        return xyProjection + yzProjection + zxProjection;
    }

