            if (c1 != c2) return false;

            int count1 = 0;
            while (i + count1 < s.length() && s.charAt(i + count1) == c1) {
                count1++;
            }

            int count2 = 0;
            while (j + count2 < word.length() && word.charAt(j + count2) == c2) {
                count2++;
            }

            if (count1 != count2 && !(count1 >= 3 || count1 <= count2)) return false;

            i += count1;
            j += count2;
        }
        return i == s.length() && j == word.length();
    }
}

