                dp[i][1] = dp[i - 1][1];
            }

            if (listB[i - 1] < listA[i] && listA[i - 1] < listB[i]) {
                dp[i][0] = Math.min(dp[i][0], dp[i - 1][1]);
            } else {
                dp[i][0] = dp[i - 1][0];
            }
        }

        return Math.min(dp[n - 1][0], dp[n - 1][1]);
    }
