import java.util.LinkedList;
import java.util.Queue;

public class Solution {
    public int numSimilarGroups(String[] strs) {
        int n = strs.length;
        boolean[][] similar = new boolean[n][n];

        // Check if two strings are similar
        for (int i = 0; i < n; i++) {
            for (int j = i + 1; j < n; j++) {
                if (isSimilar(strs[i], strs[j])) {
                    similar[i][j] = true;
                    similar[j][i] = true;
                }
            }
        }

        int count = 0;
        boolean[] visited = new boolean[n];

        // Perform BFS for each unvisited string
        for (int i = 0; i < n; i++) {
            if (!visited[i]) {
                bfs(strs, similar, visited, i);
                count++;
            }
        }

        return count;
    }

    private void bfs(String[] strs, boolean[][] similar, boolean[] visited, int index) {
        Queue<Integer> queue = new LinkedList<>();
        queue.offer(index);
        visited[index] = true;

        while (!queue.isEmpty()) {
            int current = queue.poll();

            // Visit all neighbors of the current string
            for (int i = 0; i < strs.length; i++) {
                if (!visited[i] && similar[current][i]) {
                    queue.offer(i);
                    visited[i] = true;
                }
            }
        }
    }

    private boolean isSimilar(String s1, String s2) {
        int diffCount = 0;

        // Count the number of different characters
        for (int i = 0; i < s1.length(); i++) {
            if (s1.charAt(i) != s2.charAt(i)) {
                diffCount++;
            }

            // If there are more than 2 differences, return false
            if (diffCount > 2) {
                return false;
            }
        }

        // Return true if the strings are equal or have exactly 2 differences
        return diffCount == 0 || diffCount == 2;
    }
}

