import java.util.Arrays;

public class Solution {
    public int uniqueLetterString(String s) {
        int n = s.length();
        int res = 0;

        // Store last index of a character.
        int[] lastCharIdx = new int[26];
        Arrays.fill(lastCharIdx, -1);

        // Store last to last index of a character.
        int[] prevLastCharIdx = new int[26];
        Arrays.fill(prevLastCharIdx, -1);

        for (int i = 0; i < n; i++) {
            char c = s.charAt(i);
            int idx = c - 'A';

            // Add count for curr index from index of last char appearance.
            res += (i - prevLastCharIdx[idx]) * (prevLastCharIdx[idx] - lastCharIdx[idx]);

            // Update last to last index and last index
            prevLastCharIdx[idx] = lastCharIdx[idx];
            lastCharIdx[idx] = i;
        }

        for (int idx = 0; idx < 26; idx++) {
            res += (n - prevLastCharIdx[idx]) * (prevLastCharIdx[idx] - lastCharIdx[idx]);
        }

        return res;
    }
}

