public class Solution {
    public int matrixScore(int[][] grid) {
        int m = grid.length;
        int n = grid[0].length;

        // Ensure the first column is all 1s by flipping rows as necessary
        for (int i = 0; i < m; i++) {
            if (grid[i][0] == 0) {
                flipRow(grid, i);
            }
        }

        // For each remaining column, count the number of 1s and 0s
        for (int j = 1; j < n; j++) {
            int ones = 0;
            int zeros = 0;
            for (int i = 0; i < m; i++) {
                if (grid[i][j] == 1) {
                    ones++;
                } else {
                    zeros++;
                }
            }

            // If there are more 0s than 1s, flip the column
            if (zeros > ones) {
                flipColumn(grid, j);
            }
        }

        int score = 0;
        for (int i = 0; i < m; i++) {
            int rowValue = 0;
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 1) {
                    rowValue += Math.pow(2, n - j - 1);
                }
            }
            score += rowValue;
        }

        return score;
    }

    private void flipRow(int[][] grid, int row) {
        for (int i = 0; i < grid[0].length; i++) {
            grid[row][i] ^= 1;
        }
    }

    private void flipColumn(int[][] grid, int col) {
        for (int i = 0; i < grid.length; i++) {
            grid[i][col] ^= 1;
        }
    }
}

