public class Solution {
    public List<String> subdomainVisits(String[] cpdomains) {
        Map<String, Integer> domainCount = new HashMap<>();

        for (String cpdomain : cpdomains) {
            String[] parts = cpdomain.split(" ");
            int count = Integer.parseInt(parts[0]);
            String domain = parts[1];

            updateDomainCount(domainCount, domain, count);

            int dotIndex = domain.indexOf('.');
            while (dotIndex != -1) {
                domain = domain.substring(dotIndex + 1);
                updateDomainCount(domainCount, domain, count);
                dotIndex = domain.indexOf('.');
            }
        }

        List<String> result = new ArrayList<>();
        for (Map.Entry<String, Integer> entry : domainCount.entrySet()) {
            result.add(entry.getValue() + " " + entry.getKey());
        }

        return result;
    }

    private void updateDomainCount(Map<String, Integer> domainCount, String domain, int count) {
        if (domainCount.containsKey(domain)) {
            domainCount.put(domain, domainCount.get(domain) + count);
        } else {
            domainCount.put(domain, count);
        }
    }
}

