import java.util.*;

public class Solution {
    public int rectangleArea(int[][] rectangles) {
        final int MOD = (int) 1e9 + 7;
        List<int[]> events = new ArrayList<>();

        for (int[] rect : rectangles) {
            events.add(new int[]{rect[1], rect[0], rect[2], 1});
            events.add(new int[]{rect[3], rect[0], rect[2], -1});
        }

        Collections.sort(events, (a, b) -> a[0] == b[0] ? a[3] - b[3] : a[0] - b[0]);

        List<Integer> active = new ArrayList<>();
        int area = 0;

        for (int[] event : events) {
            if (event[3] == 1) {
                active.add(event[1]);
                active.add(event[2]);
            } else {
                active.remove((Integer) event[1]);
                active.remove((Integer) event[2]);
            }

            Collections.sort(active);

            int width = 0;
            for (int i = 1; i < active.size(); i += 2) {
                width += active.get(i) - active.get(i - 1);
            }

            area = (area + width * (event[0] - (events.indexOf(event) > 0 ? events.get(events.indexOf(event) - 1)[0] : 0))) % MOD;
        }

        return area;
    }
}

