import java.util.*;

public class Solution {
    public int[] sumOfDistancesInTree(int n, int[][] edges) {
        List<List<Integer>> graph = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            graph.add(new ArrayList<>());
        }

        for (int[] edge : edges) {
            graph.get(edge[0]).add(edge[1]);
            graph.get(edge[1]).add(edge[0]);
        }

        int[] count = new int[n];
        int[] res = new int[n];

        dfs(graph, 0, -1, count);
        dfs2(graph, 0, -1, n, count, res);

        return res;
    }

    private void dfs(List<List<Integer>> graph, int node, int parent, int[] count) {
        for (int child : graph.get(node)) {
            if (child != parent) {
                dfs(graph, child, node, count);
                count[node] += count[child];
            }
        }
        count[node]++;
    }

    private void dfs2(List<List<Integer>> graph, int node, int parent, int n, int[] count, int[] res) {
        for (int child : graph.get(node)) {
            if (child != parent) {
                res[child] = n - count[child] + res[node];
                dfs2(graph, child, node, n, count, res);
            }
        }
    }
}

