public class Solution {
    public boolean buddyStrings(String s, String goal) {
        if (s.length() != goal.length()) return false;

        int[] count = new int[26];
        for (char c : s.toCharArray()) {
            count[c - 'a']++;
        }

        boolean hasDuplicate = false;
        for (int i : count) {
            if (i > 1) {
                hasDuplicate = true;
                break;
