        }

        int diffCount = 0;
        char[] sArray = s.toCharArray();
        char[] goalArray = goal.toCharArray();
        char firstDiff = ' ';
        char secondDiff = ' ';

        for (int i = 0; i < s.length(); i++) {
            if (sArray[i] != goalArray[i]) {
                diffCount++;
                if (diffCount == 1) {
                    firstDiff = sArray[i];
                    secondDiff = goalArray[i];
                } else if (diffCount == 2) {
                    if (firstDiff != goalArray[i] || secondDiff != sArray[i]) return false;
                } else {
                    return false;
                }
            }
        }

        return diffCount == 2 || (hasDuplicate && diffCount == 0);
    }
}

