public class Solution {
    public int minPathCost(int[][] grid, int[][] moveCost) {
        int m = grid.length;
        int n = grid[0].length;
        int[][] dp = new int[m][n];

        // Initialize the first row of dp with the values from the grid
        for (int j = 0; j < n; j++) {
            dp[0][j] = grid[0][j];
        }

        // Fill up the rest of the dp table
        for (int i = 1; i < m; i++) {
            for (int j = 0; j < n; j++) {
                int minCost = Integer.MAX_VALUE;
                for (int k = 0; k < n; k++) {
                    // Calculate the cost of moving from cell (i-1, k) to cell (i, j)
                    int cost = dp[i - 1][k] + moveCost[grid[i - 1][k]][j] + grid[i][j];
                    minCost = Math.min(minCost, cost);
                }
                dp[i][j] = minCost;
            }
        }

        // Find the minimum cost in the last row of dp
        int minPathCost = Integer.MAX_VALUE;
        for (int j = 0; j < n; j++) {
            minPathCost = Math.min(minPathCost, dp[m - 1][j]);
        }

        return minPathCost;
    }
}

