        if (node == null || visited[node.val]) return;

        visited[node.val] = true;

        if (node.val == target) {
            maxDepth[0] = Math.max(maxDepth[0], depth);
        } else {
            dfs(node.left, target, depth + 1, visited, maxDepth);
            dfs(node.right, target, depth + 1, visited, maxDepth);
        }

        if (node.val != target) {
            maxDepth[0] = Math.max(maxDepth[0], depth);
        }
    }
