public class Solution {
    public int closestMeetingNode(int[] edges, int node1, int node2) {
        Set<Integer> visited = new HashSet<>();
        int minDistance = Integer.MAX_VALUE;
        int result = -1;

        for (int i = 0; i < edges.length; i++) {
            if (edges[i] == -1) continue;
            visited.add(i);
        }

        int[] distanceFromNode1 = getDistances(edges, node1);
        int[] distanceFromNode2 = getDistances(edges, node2);

        for (int i = 0; i < edges.length; i++) {
            if (distanceFromNode1[i] != -1 && distanceFromNode2[i] != -1) {
                int maxDistance = Math.max(distanceFromNode1[i], distanceFromNode2[i]);
                if (maxDistance < minDistance || (maxDistance == minDistance && (result == -1 || i < result))) {
                    minDistance = maxDistance;
                    result = i;
                }
            }
        }

        return result;
    }

    private int[] getDistances(int[] edges, int start) {
        int n = edges.length;
        int[] distances = new int[n];
        for (int i = 0; i < n; i++) distances[i] = -1;

        int distance = 0;
        Set<Integer> visited = new HashSet<>();
        while (start != -1 && !visited.contains(start)) {
            visited.add(start);
            distances[start] = distance++;
            start = edges[start];
        }

        return distances;
    }
}

