import java.util.HashSet;
import java.util.Set;

public class Solution {
    public boolean matchReplacement(String s, String sub, char[][] mappings) {
        Set<Character>[] mapping = new HashSet[26];
        for (int i = 0; i < 26; i++) {
            mapping[i] = new HashSet<>();
        }

        for (char[] map : mappings) {
            mapping[map[0] - 'a'].add(map[1]);
        }

        int n = s.length();
        int m = sub.length();

        for (int i = 0; i <= n - m; i++) {
            boolean match = true;
            Set<Character>[] used = new HashSet[26];
            for (int j = 0; j < 26; j++) {
                used[j] = new HashSet<>();
            }

            for (int j = 0; j < m; j++) {
                char c1 = s.charAt(i + j);
                char c2 = sub.charAt(j);

                if (c1 == c2) continue;

                if (!mapping[c2 - 'a'].contains(c1)) {
                    match = false;
                    break;
                }

                if (used[c2 - 'a'].contains(c1)) {
                    match = false;
                    break;
                }

                used[c2 - 'a'].add(c1);
            }

            if (match) return true;
        }

        return false;
    }
}

