public class Solution {
    public boolean canChange(String start, String target) {
        int n = start.length();

        // Check if the number of 'L' and 'R' in both strings are equal
        int countLStart = 0;
        int countRStart = 0;
        int countLTarget = 0;
        int countRTarget = 0;

        for (int i = 0; i < n; i++) {
            if (start.charAt(i) == 'L') {
                countLStart++;
            } else if (start.charAt(i) == 'R') {
                countRStart++;
            }

            if (target.charAt(i) == 'L') {
                countLTarget++;
            } else if (target.charAt(i) == 'R') {
                countRTarget++;
            }
        }

        // If the counts are not equal, return false
        if (countLStart != countLTarget || countRStart != countRTarget) {
            return false;
        }

        int i = 0, j = 0;

        while (i < n && j < n) {
            // Skip '_' in both strings
            while (i < n && start.charAt(i) == '_') {
                i++;
            }

            while (j < n && target.charAt(j) == '_') {
                j++;
            }

            // If we have reached the end of either string, return true if both are at the end, false otherwise
            if (i >= n || j >= n) {
                return i == n && j == n;
            }

            // Check if the current characters match and the 'L' is not to the right of its target position and 'R' is not to the left of its target position
            if (start.charAt(i) != target.charAt(j) || (start.charAt(i) == 'L' && i < j) || (start.charAt(i) == 'R' && i > j)) {
                return false;
            }

            // Move to the next character in both strings
            i++;
            j++;
        }

        // If we have reached this point, it means that one string has more characters than the other
        return false;
    }
}

