// #2022_06_16_Time_14_ms_(84.35%)_Space_39.6_MB_(92.46%)
public class Solution {
    public int distributeCookies(int[] cookies, int k) {
        Arrays.sort(cookies);
        int n = cookies.length;
        int[] children = new int[k];

        return backtrack(cookies, children, 0, n - 1);
    }

    private int backtrack(int[] cookies, int[] children, int start, int end) {
        if (start > end) {
            int max = Integer.MIN_VALUE;
            for (int child : children) {
                max = Math.max(max, child);
            }
            return max;
        }

        int min = Integer.MAX_VALUE;
        for (int i = 0; i < children.length; i++) {
            if (children[i] + cookies[end] <= min) {
                children[i] += cookies[end];
                min = Math.min(min, backtrack(cookies, children, start, end - 1));
                children[i] -= cookies[end];
            }
        }

        return min;
    }
}

