public class Solution {
    public int garbageCollection(String[] garbage, int[] travel) {
        int metal = 0;
        int paper = 0;
        int glass = 0;

        for (String s : garbage) {
            for (char c : s.toCharArray()) {
                if (c == 'M') {
                    metal++;
                } else if (c == 'P') {
                    paper++;
                } else if (c == 'G') {
                    glass++;
                }
            }
        }

        int[] prefixSum = new int[travel.length + 1];
        for (int i = 0; i < travel.length; i++) {
            prefixSum[i + 1] = prefixSum[i] + travel[i];
        }

        return collectGarbage(garbage, metal, 'M', prefixSum) +
               collectGarbage(garbage, paper, 'P', prefixSum) +
               collectGarbage(garbage, glass, 'G', prefixSum);
    }

    private int collectGarbage(String[] garbage, int total, char type, int[] prefixSum) {
        int lastHouse = -1;
        for (int i = 0; i < garbage.length; i++) {
            if (garbage[i].indexOf(type) != -1) {
                lastHouse = i;
            }
        }

        if (lastHouse == -1) return 0;

        int time = total + prefixSum[lastHouse];

        for (int i = 0; i < garbage.length - 1; i++) {
            boolean hasType = false;
            for (int j = i + 1; j <= lastHouse; j++) {
                if (garbage[j].indexOf(type) != -1) {
                    hasType = true;
                    break;
                }
            }

            if (!hasType) continue;

            int count = 0;
            for (int j = i + 1; j <= lastHouse; j++) {
                if (garbage[j].indexOf(type) != -1) {
                    count += travel[j];
                }
            }

            time = Math.min(time, total + prefixSum[i] + count);
        }

        return time;
    }
}

