public class Solution {
    public int maximumSum(int[] nums) {
        Map<Integer, Integer> map = new HashMap<>();
        for (int num : nums) {
            int sumOfDigits = getSumOfDigits(num);
            if (!map.containsKey(sumOfDigits)) {
                map.put(sumOfDigits, num);
            } else {
                map.put(sumOfDigits, Math.max(map.get(sumOfDigits), num));
            }
        }

        int maxSum = 0;
        for (int sumOfDigits : map.keySet()) {
            int count = 0;
            for (int num : nums) {
                if (getSumOfDigits(num) == sumOfDigits) {
                    count++;
                    if (count > 1) {
                        return map.get(sumOfDigits) + num;
                    }
                }
            }
        }

        for (int i = 0; i < nums.length; i++) {
            for (int j = i + 1; j < nums.length; j++) {
                if (getSumOfDigits(nums[i]) == getSumOfDigits(nums[j])) {
                    maxSum = Math.max(maxSum, nums[i] + nums[j]);
                }
            }
        }

        return maxSum;
    }

    private int getSumOfDigits(int num) {
        int sum = 0;
        while (num > 0) {
            sum += num % 10;
            num /= 10;
        }
        return sum;
    }
}

