public class Solution {
    private static final int MOD = (int) 1e9 + 7;
    private static final int[][] DIRECTIONS = {{0, 1}, {0, -1}, {1, 0}, {-1, 0}};

    public int countPaths(int[][] grid) {
        int m = grid.length;
        int n = grid[0].length;
        long[][] memo = new long[m][n];

        for (int i = 0; i < m; i++) {
            Arrays.fill(memo[i], -1);
        }

        long count = 0;

        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                count += dfs(grid, memo, i, j);
                count %= MOD;
            }
        }

        return (int) count;
    }

    private long dfs(int[][] grid, long[][] memo, int x, int y) {
        if (memo[x][y] != -1) {
            return memo[x][y];
        }

        long count = 1;

        for (int[] direction : DIRECTIONS) {
            int newX = x + direction[0];
            int newY = y + direction[1];

            if (newX >= 0 && newX < grid.length && newY >= 0 && newY < grid[0].length && grid[newX][newY] > grid[x][y]) {
                count += dfs(grid, memo, newX, newY);
                count %= MOD;
            }
        }

        return memo[x][y] = count;
    }
}

