public class Solution {
    public int countSpecialNumbers(int n) {
        char[] str = String.valueOf(n).toCharArray();
        int len = str.length;
        int res = 0;

        // calculate special numbers with less digits than n
        for (int i = 1; i < len; i++) {
            res += 9 * perm(9, i - 1);
        }

        // calculate special numbers with same digits as n
        boolean[] visited = new boolean[10];
        res += dfs(str, 0, visited);

        return res;
    }

    private int dfs(char[] str, int index, boolean[] visited) {
        if (index == str.length) {
            return 1;
        }

        int res = 0;
        for (int i = index == 0 ? 1 : 0; i <= str[index] - '0'; i++) {
            if (visited[i]) continue;
            visited[i] = true;
            res += dfs(str, index + 1, visited);
            visited[i] = false;
        }

        return res;
    }

    private int perm(int m, int n) {
        int res = 1;
        for (int i = m; i > m - n; i--) {
            res *= i;
        }
        return res;
    }
}

