public class Solution {
    private int minScore = Integer.MAX_VALUE;
    private int totalXor;
    private Map<Integer, List<Integer>> graph;
    private boolean[] blocked;

    public int minimumScore(int[] nums, int[][] edges) {
        // Initializing the graph and finding the total XOR
        graph = new HashMap<>();
        for (int i = 0; i < nums.length; i++) {
            graph.put(i, new ArrayList<>());
        }
        totalXor = 0;
        for (int num : nums) {
            totalXor ^= num;
        }

        // adding the edges
        for (int[] edge : edges) {
            int u = edge[0];
            int v = edge[1];
            graph.get(u).add(v);
            graph.get(v).add(u);
        }

        blocked = new boolean[nums.length];

        dfs(0, -1);

        return minScore;
    }

    private void dfs(int src, int parent) {
        // Setting the value for the current subtree's XOR value
        int xor = 0;

        for (int nbr : graph.get(src)) {
            if (nbr != parent && !blocked[nbr]) {
                // After selecting 'src <----> nbr' as the first edge, we block 'nbr' node and then
                // make a call to try all the second edges
                blocked[nbr] = true;
                dfsSecondTime(src, -1, xor ^ nums[src], 0);
                blocked[nbr] = false;

                // Including the neighbour subtree's XOR value in the XOR value of the subtree
                // rooted at src node
                int tempXor = dfs(nbr, src);
                xor ^= tempXor;
            }
        }

        // Returing the XOR value of the current subtree rooted at the src node
    }

    private void dfsSecondTime(int src, int parent, int firstComponentXor, int secondEdgeStart) {
        // Setting the value for the current subtree's XOR value
        int xor = 0;

        for (int nbr : graph.get(src)) {
            if (nbr != parent && !blocked[nbr] && nbr != secondEdgeStart) {
                // 'src <----> nbr' is the second edge to be removed
                // Getting the XOR value of the current neighbor
                int tempXor = dfsSecondTimeHelper(nbr, src);

                // The XOR of the remaining component
                int thirdComponentXor = totalXor ^ firstComponentXor ^ tempXor;

                // Getting the minimum of the three values
                int min = Math.min(firstComponentXor, Math.min(tempXor, thirdComponentXor));

                // Getting the maximum of the three value
                int max = Math.max(firstComponentXor, Math.max(tempXor, thirdComponentXor));

                // Updating the minimum score
                minScore = Math.min(minScore, max - min);

                // Including the neighbour subtree's XOR value in the XOR value of the subtree
                // rooted at src node
                xor ^= tempXor;
            }
        }

        // Returing the XOR value of the current subtree rooted at the src node
    }

    private int dfsSecondTimeHelper(int src, int parent) {
        // Setting the value for the current subtree's XOR value
        int xor = nums[src];

        for (int nbr : graph.get(src)) {
            if (nbr != parent && !blocked[nbr]) {
                // Including the neighbour subtree's XOR value in the XOR value of the subtree
                // rooted at src node
                xor ^= dfsSecondTimeHelper(nbr, src);
            }
        }

        return xor;
    }

    private int dfs(int src, int parent) {
        // Setting the value for the current subtree's XOR value
        int xor = nums[src];

        for (int nbr : graph.get(src)) {
            if (nbr != parent && !blocked[nbr]) {
                // Including the neighbour subtree's XOR value in the XOR value of the subtree
                // rooted at src node
                xor ^= dfs(nbr, src);
            }
        }

        return xor;
    }
