public class Solution {
    public int[] maxSegmentSum(int[] nums, int[] removeQueries) {
        int n = nums.length;
        int[] answer = new int[n];
        UnionFind uf = new UnionFind(n);

        for (int i = 0; i < n; i++) {
            if (i > 0 && nums[i] > 0 && nums[i - 1] > 0) {
                uf.union(i, i - 1);
            }
            if (i < n - 1 && nums[i] > 0 && nums[i + 1] > 0) {
                uf.union(i, i + 1);
            }
        }

        int[] removed = new int[n];
        for (int i = 0; i < n; i++) {
            removed[removeQueries[i]] = 1;
        }

        int[][] segments = getSegments(nums, removed);

        for (int i = n - 1; i >= 0; i--) {
            answer[i] = getMaxSegmentSum(segments);
            if (removed[removeQueries[i]] == 1) {
                removed[removeQueries[i]] = 0;
                segments = getSegments(nums, removed);
            }
        }

        return answer;
    }

    private int[][] getSegments(int[] nums, int[] removed) {
        List<int[]> segments = new ArrayList<>();
        int start = -1;

        for (int i = 0; i < nums.length; i++) {
            if (nums[i] > 0 && removed[i] == 0) {
                if (start == -1) {
                    start = i;
                }
            } else {
                if (start != -1) {
                    segments.add(new int[]{start, i});
                    start = -1;
                }
            }
        }

        if (start != -1) {
            segments.add(new int[]{start, nums.length});
        }

        return segments.toArray(new int[0][]);
    }

    private int getMaxSegmentSum(int[][] segments) {
        int maxSum = 0;

        for (int[] segment : segments) {
            int sum = 0;
            for (int i = segment[0]; i < segment[1]; i++) {
                sum += nums[i];
            }
            maxSum = Math.max(maxSum, sum);
        }

        return maxSum;
    }

    private int[] nums;

    public Solution() {}

    class UnionFind {
        int[] parent;
        int[] size;

        public UnionFind(int n) {
            parent = new int[n];
            size = new int[n];

            for (int i = 0; i < n; i++) {
                parent[i] = i;
                size[i] = 1;
            }
        }

        public void union(int x, int y) {
            int rootX = find(x);
            int rootY = find(y);

            if (rootX != rootY) {
                if (size[rootX] > size[rootY]) {
                    parent[rootY] = rootX;
                    size[rootX] += size[rootY];
                } else {
                    parent[rootX] = rootY;
                    size[rootY] += size[rootX];
                }
            }
        }

        public int find(int x) {
            if (parent[x] != x) {
                parent[x] = find(parent[x]);
            }
            return parent[x];
        }
    }
}

