public class Solution {
    public int maximumGroups(int[] grades) {
        int n = grades.length;
        int sum = 0;
        for (int grade : grades) {
            sum += grade;
        }

        int low = 1, high = n;
        while (low <= high) {
            int mid = low + (high - low) / 2;
            if (canFormGroups(grades, mid)) {
                low = mid + 1;
            } else {
                high = mid - 1;
            }
        }

        return high;
    }

    private boolean canFormGroups(int[] grades, int k) {
        long[] prefixSum = new long[grades.length + 1];
        for (int i = 0; i < grades.length; i++) {
            prefixSum[i + 1] = prefixSum[i] + grades[i];
        }

        long lastSum = 0;
        int lastIndex = -1;
        for (int i = k; i <= grades.length; i++) {
            if (prefixSum[i] - prefixSum[lastIndex + 1] > lastSum && i - lastIndex - 1 > k - 1) {
                lastSum = prefixSum[i] - prefixSum[lastIndex + 1];
                lastIndex = i;
                k--;
            }
        }

        return k == 0;
    }
}

