    public String bestHand(int[] ranks, char[] suits) {
        HashMap<Character, Integer> suitMap = new HashMap<>();

        // Check for flush
        for (char c : suits) {
            suitMap.put(c, suitMap.getOrDefault(c, 0) + 1);
        }
        if (suitMap.size() == 1) return "Flush";

        HashMap<Integer, Integer> rankMap = new HashMap<>();

        // Check for three of a kind and pair
        for (int rank : ranks) {
            rankMap.put(rank, rankMap.getOrDefault(rank, 0) + 1);
        }
        if (rankMap.containsValue(3)) return "Three of a Kind";
        else if (rankMap.containsValue(2)) return "Pair";

        // If none of the above conditions are met, it's a high card
        return "High Card";
    }
}

