import java.util.*;

public class Solution {
    public int maximumRows(int[][] matrix, int numSelect) {
        int m = matrix.length;
        int n = matrix[0].length;

        // Initialize a set to store the rows that are covered by the selected columns
        Set<Integer> coveredRows = new HashSet<>();

        // Define a helper function for backtracking
        return backtrack(matrix, numSelect, 0, coveredRows);
    }

    private int backtrack(int[][] matrix, int numSelect, int startCol, Set<Integer> coveredRows) {
        if (numSelect == 0) {
            // If no more columns to select, count the number of rows that are covered
            return countCoveredRows(matrix, coveredRows);
        }

        int maxCovered = 0;
        for (int col = startCol; col <= matrix[0].length - numSelect; col++) {
            // Select this column and update the set of covered rows
            Set<Integer> newCoveredRows = new HashSet<>(coveredRows);
            for (int row = 0; row < matrix.length; row++) {
                if (!newCoveredRows.contains(row) && isRowCovered(matrix, row, col)) {
                    newCoveredRows.add(row);
                }
            }

            // Recursively select the remaining columns
            int covered = backtrack(matrix, numSelect - 1, col + 1, newCoveredRows);
            maxCovered = Math.max(maxCovered, covered);
        }

        return maxCovered;
    }

    private boolean isRowCovered(int[][] matrix, int row, int selectedCol) {
        for (int col = 0; col < matrix[0].length; col++) {
            if (matrix[row][col] == 1 && col != selectedCol) {
                return false;
            }
        }
        return true;
    }

    private int countCoveredRows(int[][] matrix, Set<Integer> coveredRows) {
        int count = 0;
        for (int row = 0; row < matrix.length; row++) {
            boolean isCovered = true;
            for (int col = 0; col < matrix[0].length; col++) {
                if (matrix[row][col] == 1 && !coveredRows.contains(row)) {
                    isCovered = false;
                    break;
                }
            }
            if (isCovered) {
                count++;
            }
        }
        return count;
    }
}

