import java.util.*;

public class Solution {
    // Using topological sort to solve this problem
    public int[][] buildMatrix(int k, int[][] rowC, int[][] colC) {
        Map<Integer, List<Integer>> graph = new HashMap<>();
        int[] indegree = new int[k + 1];

        for (int i = 1; i <= k; i++) {
            graph.put(i, new ArrayList<>());
        }

        // Build the graph based on row conditions
        for (int[] condition : rowC) {
            int above = condition[0];
            int below = condition[1];
            graph.get(above).add(below);
            indegree[below]++;
        }

        // Build the graph based on column conditions
        for (int[] condition : colC) {
            int left = condition[0];
            int right = condition[1];
            graph.get(left).add(right);
            indegree[right]++;
        }

        Queue<Integer> queue = new LinkedList<>();
        List<Integer> order = new ArrayList<>();

        // Add nodes with 0 in-degree to the queue
        for (int i = 1; i <= k; i++) {
            if (indegree[i] == 0) {
                queue.offer(i);
            }
        }

        while (!queue.isEmpty()) {
            int node = queue.poll();
            order.add(node);

            // Decrease in-degree of neighboring nodes
            for (int neighbor : graph.get(node)) {
                indegree[neighbor]--;
                if (indegree[neighbor] == 0) {
                    queue.offer(neighbor);
                }
            }
        }

        // If there's a cycle, return an empty matrix
        if (order.size() != k) {
            return new int[][] {};
        }

        // Build the matrix based on the topological order
        int[][] matrix = new int[k][k];
        for (int i = 0; i < k; i++) {
            for (int j = 0; j < k; j++) {
                if (i == j) {
                    matrix[i][j] = order.get(i);
                } else {
                    matrix[i][j] = -1;
                }
            }
        }

        return matrix;
    }
}

