import java.util.*;

public class Solution {
    public int reachableNodes(int n, int[][] edges, int[] restricted) {
        List<List<Integer>> graph = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            graph.add(new ArrayList<>());
        }

        Set<Integer> restrictedSet = new HashSet<>();
        for (int node : restricted) {
            restrictedSet.add(node);
        }

        for (int[] edge : edges) {
            if (!restrictedSet.contains(edge[0]) && !restrictedSet.contains(edge[1])) {
                graph.get(edge[0]).add(edge[1]);
                graph.get(edge[1]).add(edge[0]);
            }
        }

        boolean[] visited = new boolean[n];
        return dfs(graph, 0, restrictedSet, visited);
    }

    private int dfs(List<List<Integer>> graph, int node, Set<Integer> restrictedSet, boolean[] visited) {
        if (visited[node] || restrictedSet.contains(node)) {
            return 0;
        }

        visited[node] = true;
        int count = 1;

        for (int neighbor : graph.get(node)) {
            count += dfs(graph, neighbor, restrictedSet, visited);
        }

        return count;
    }
}

