        int count = 0;

        for (int i = 0; i < n; i++) {
            for (int j = i + 1; j <= n; j++) {
                int[] subarray = new int[j - i];
                System.arraycopy(nums, i, subarray, 0, j - i);

                // Sort the subarray
                java.util.Arrays.sort(subarray);

                // Calculate the median of the subarray
