        int prevTime = 0;
        for (int[] log : logs) {
            int currId = log[0];
            int currLeaveTime = log[1];

            int timeSpent = currLeaveTime - prevTime;
            if (timeSpent > maxTime || (timeSpent == maxTime && currId < id)) {
                maxTime = timeSpent;
                id = currId;
            }

            prevTime = currLeaveTime;
        }

        return id;
    }
}

