public class Solution {
    public int longestSubarray(int[] nums) {
        int n = nums.length;
        int maxVal = 0;

        // Find the maximum value in the array
        for (int num : nums) {
            maxVal = Math.max(maxVal, num);
        }

        int maxLength = 0;

        // Iterate over all possible subarrays
        for (int i = 0; i < n; i++) {
            for (int j = i + 1; j <= n; j++) {
                int[] subarray = new int[j - i];

                // Create the current subarray
                System.arraycopy(nums, i, subarray, 0, j - i);

                // Calculate the bitwise AND of the current subarray
                int andVal = subarray[0];
                for (int k = 1; k < subarray.length; k++) {
                    andVal &= subarray[k];
                }

                // If the bitwise AND is equal to the maximum value, update the maxLength
                if (andVal == maxVal) {
                    maxLength = Math.max(maxLength, j - i);
                }
            }
        }

        return maxLength;
    }
}

