import com_github_leetcode.TreeNode;
import java.util.HashMap;
import java.util.Map;

public class Solution {
    public int[] treeQueries(TreeNode root, int[] queries) {
        Map<Integer, TreeNode> parentMap = new HashMap<>();
        dfs(root, null, parentMap);

        int n = queries.length;
        int[] result = new int[n];

        for (int i = 0; i < n; i++) {
            int query = queries[i];
            TreeNode node = findNode(root, query);

            if (node == null) continue;

            TreeNode parent = parentMap.get(query);
            if (parent.left == node) {
                parent.left = null;
            } else {
                parent.right = null;
            }

            result[i] = getHeight(root);

            // restore the tree
            if (parent.left == null) {
                parent.left = node;
            } else {
                parent.right = node;
            }
        }

        return result;
    }

    private void dfs(TreeNode root, TreeNode parent, Map<Integer, TreeNode> parentMap) {
        if (root == null) return;

        parentMap.put(root.val, parent);
        dfs(root.left, root, parentMap);
        dfs(root.right, root, parentMap);
    }

    private int getHeight(TreeNode root) {
        if (root == null) return -1;

        return 1 + Math.max(getHeight(root.left), getHeight(root.right));
    }

    private TreeNode findNode(TreeNode root, int val) {
        if (root == null || root.val == val) return root;

        TreeNode left = findNode(root.left, val);
        if (left != null) return left;

        return findNode(root.right, val);
    }
}

