import java.util.Arrays;
import java.util.List;

public class Solution {
    public long minimumTotalDistance(List<Integer> robot, int[][] f) {
        // Convert List to array for easier manipulation
        int[] robots = new int[robot.size()];
        for (int i = 0; i < robot.size(); i++) {
            robots[i] = robot.get(i);
        }

        // Sort factories by x-position in asc order, move all factories with 0-capacity to the end
        Arrays.sort(f, (a, b) -> a[1] == 0 && b[1] != 0 ? 1 : a[1] != 0 && b[1] == 0 ? -1 : Integer.compare(a[0], b[0]));

        // Sort robots by x-position in asc order
        Arrays.sort(robots);

        long result = 0;
        int robotIndex = 0;

        for (int[] factory : f) {
            if (factory[1] == 0) continue; // Skip factories with 0 capacity

            int assignedRobots = Math.min(factory[1], robots.length - robotIndex);
            int[] assignedRobotPositions = new int[assignedRobots];

            for (int i = 0; i < assignedRobots; i++) {
                assignedRobotPositions[i] = robots[robotIndex + i];
            }

            Arrays.sort(assignedRobotPositions);

            // Calculate the median of assigned robot positions
            int medianPosition;
            if (assignedRobots % 2 == 1) {
                medianPosition = assignedRobotPositions[assignedRobots / 2];
            } else {
                medianPosition = (assignedRobotPositions[assignedRobots / 2 - 1] + assignedRobotPositions[assignedRobots / 2]) / 2;
            }

            // Calculate the total distance for assigned robots
            for (int position : assignedRobotPositions) {
                result += Math.abs(position - medianPosition);
            }
            result += Math.abs(medianPosition - factory[0]);

            robotIndex += assignedRobots;
        }

        return result;
    }
}

