public class Solution {
    public int[][] closestNodes(TreeNode root, int[] queries) {
        List<Integer> inorder = new ArrayList<>();
        dfs(root, inorder);

        int n = queries.length;
        int[][] answer = new int[n][2];

        for (int i = 0; i < n; i++) {
            int query = queries[i];

            // Find the largest value in the tree that is smaller than or equal to queries[i]
            int min_i = -1;
            for (int num : inorder) {
                if (num <= query && (min_i == -1 || num > min_i)) {
                    min_i = num;
                }
            }

            // Find the smallest value in the tree that is greater than or equal to queries[i]
            int max_i = -1;
            for (int num : inorder) {
                if (num >= query && (max_i == -1 || num < max_i)) {
                    max_i = num;
                }
            }

            answer[i][0] = min_i;
            answer[i][1] = max_i;
        }

        return answer;
    }

    private void dfs(TreeNode root, List<Integer> inorder) {
        if (root == null) {
            return;
        }

        dfs(root.left, inorder);
        inorder.add(root.val);
        dfs(root.right, inorder);
    }
}

