// #2023_01_07_Time_57_ms_(96.24%)_Space_54_MB_(92.26%)
import java.util.PriorityQueue;

public class Solution {
    public long totalCost(int[] costs, int k, int candidates) {
        PriorityQueue<Integer> leftHeap = new PriorityQueue<>((a, b) -> costs[a] == costs[b] ? a - b : costs[a] - costs[b]);
        PriorityQueue<Integer> rightHeap = new PriorityQueue<>((a, b) -> costs[a] == costs[b] ? b - a : costs[a] - costs[b]);

        for (int i = 0; i < candidates && i < costs.length; i++) {
            leftHeap.offer(i);
        }
        for (int i = costs.length - 1, j = 0; j < candidates && i >= 0; i--, j++) {
            rightHeap.offer(i);
        }

        long totalCost = 0;
        int leftIndex = 0;
        int rightIndex = costs.length - 1;

        for (int i = 0; i < k; i++) {
            if (leftHeap.isEmpty()) {
                totalCost += costs[rightHeap.poll()];
                if (rightIndex > leftIndex + candidates) {
                    rightHeap.offer(rightIndex--);
                }
            } else if (rightHeap.isEmpty()) {
                totalCost += costs[leftHeap.poll()];
                if (leftIndex < costs.length - 1 - candidates) {
                    leftHeap.offer(++leftIndex);
                }
            } else {
                int leftTop = leftHeap.peek();
                int rightTop = rightHeap.peek();
                if (costs[leftTop] <= costs[rightTop]) {
                    totalCost += costs[leftHeap.poll()];
                    if (leftIndex < costs.length - 1 - candidates) {
                        leftHeap.offer(++leftIndex);
                    }
                } else {
                    totalCost += costs[rightHeap.poll()];
                    if (rightIndex > leftIndex + candidates) {
                        rightHeap.offer(rightIndex--);
                    }
                }
            }
        }

        return totalCost;
    }
}

