public class Solution {
    public int maxStarSum(int[] nodeValues, int[][] edges, int maxNumberOfEdges) {
        Map<Integer, List<Integer>> graph = new HashMap<>();

        for (int i = 0; i < nodeValues.length; i++) {
            graph.put(i, new ArrayList<>());
        }

        for (int[] edge : edges) {
            graph.get(edge[0]).add(edge[1]);
            graph.get(edge[1]).add(edge[0]);
        }

        int maxStarSum = Integer.MIN_VALUE;

        for (int i = 0; i < nodeValues.length; i++) {
            PriorityQueue<Integer> pq = new PriorityQueue<>((a, b) -> Integer.compare(nodeValues[b], nodeValues[a]));

            for (int neighbor : graph.get(i)) {
                pq.offer(neighbor);
            }

            int currentSum = nodeValues[i];
            int edgeCount = 0;

            while (!pq.isEmpty() && edgeCount < maxNumberOfEdges) {
                int neighbor = pq.poll();
                currentSum += nodeValues[neighbor];
                edgeCount++;
            }

            maxStarSum = Math.max(maxStarSum, currentSum);
        }

        return maxStarSum;
    }
}

