public class Solution {
    public int maxJump(int[] stones) {
        int n = stones.length;
        int left = 0, right = stones[n - 1] - stones[0];

        while (left < right) {
            int mid = left + (right - left) / 2;
            if (canJump(stones, mid)) {
                right = mid;
            } else {
                left = mid + 1;
            }
        }

        return left;
    }

    private boolean canJump(int[] stones, int maxJump) {
        int n = stones.length;
        int lastPosition = stones[n - 1];
        int currentPosition = stones[0];

        for (int i = 1; i < n; i++) {
            if (lastPosition - stones[i] <= maxJump && stones[i] - currentPosition <= maxJump) {
                currentPosition = stones[i];
            }
        }

        return lastPosition - currentPosition <= maxJump;
    }
}

