// #Hard #Array #Dynamic_Programming #Matrix #2022_12_07_Time_70_ms_(99.20%)_Space_84.5_MB_(87.93%)
import java.util.Arrays;

public class Solution {
    private static final int MOD = (int) 1e9 + 7;

    public int numberOfPaths(int[][] grid, int k) {
        int m = grid.length;
        int n = grid[0].length;

        // Calculate prefix sum for each cell
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (i > 0) {
                    grid[i][j] += grid[i - 1][j];
                }
                if (j > 0) {
                    grid[i][j] += grid[i][j - 1];
                }
                if (i > 0 && j > 0) {
                    grid[i][j] -= grid[i - 1][j - 1];
                }
            }
        }

        // Initialize dp array
        int[][][] dp = new int[m][n][k];

        // Base case: only one way to reach (0, 0)
        dp[0][0][grid[0][0] % k] = 1;

        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (i == 0 && j == 0) continue;

                // Calculate sum of elements on the path
                int sum = grid[i][j];
                if (i > 0) sum -= grid[i - 1][j];
                if (j > 0) sum -= grid[i][j - 1];
                if (i > 0 && j > 0) sum += grid[i - 1][j - 1];

                // Update dp array
                for (int x = 0; x < k; x++) {
                    int y = (sum % k + x) % k;
                    if (i > 0) {
                        dp[i][j][(x + sum) % k] += dp[i - 1][j][y];
                        dp[i][j][(x + sum) % k] %= MOD;
                    }
                    if (j > 0) {
                        dp[i][j][(x + sum) % k] += dp[i][j - 1][y];
                        dp[i][j][(x + sum) % k] %= MOD;
                    }
                }
            }
        }

        // Return the number of paths where the sum is divisible by k
        return dp[m - 1][n - 1][0];
    }
}

