public class Solution {
    public List<Integer> goodIndices(int[] nums, int k) {
        int n = nums.length;
        List<Integer> result = new ArrayList<>();

        for (int i = k; i < n - k; i++) {
            boolean isNonIncreasingBefore = true;
            boolean isNonDecreasingAfter = true;

            // Check if the elements before index i are in non-increasing order
            for (int j = i - 1; j >= i - k; j--) {
                if (nums[j] < nums[j + 1]) {
                    isNonIncreasingBefore = false;
                    break;
                }
            }

            // Check if the elements after index i are in non-decreasing order
            for (int j = i + 1; j <= i + k; j++) {
                if (nums[j] < nums[j - 1]) {
                    isNonDecreasingAfter = false;
                    break;
                }
            }

            // If both conditions are satisfied, add index i to the result
            if (isNonIncreasingBefore && isNonDecreasingAfter) {
                result.add(i);
            }
        }

        return result;
    }
}

