import java.util.*;

public class Solution {
    private int maxProfit = Integer.MIN_VALUE;
    private Map<Integer, List<Integer>> graph;

    public int mostProfitablePath(int[][] edges, int bob, int[] amount) {
        // Build the graph
        graph = new HashMap<>();
        for (int i = 0; i < edges.length; i++) {
            int u = edges[i][0];
            int v = edges[i][1];
            if (!graph.containsKey(u)) {
                graph.put(u, new ArrayList<>());
            }
            if (!graph.containsKey(v)) {
                graph.put(v, new ArrayList<>());
            }
            graph.get(u).add(v);
            graph.get(v).add(u);
        }

        // Perform DFS to find the maximum profit
        dfs(0, -1, amount, bob);

        return maxProfit;
    }

    private int dfs(int node, int parent, int[] amount, int bob) {
        if (node == bob) {
            return 0;
        }
        boolean isLeaf = graph.get(node).size() == 1 && graph.get(node).get(0) == parent;

        // If the current node is a leaf node
        if (isLeaf) {
            maxProfit = Math.max(maxProfit, amount[node]);
            return amount[node];
        }

        int maxChildProfit = Integer.MIN_VALUE;
        for (int child : graph.get(node)) {
            if (child != parent) {
                maxChildProfit = Math.max(maxChildProfit, dfs(child, node, amount, bob));
            }
        }

        // Update the maximum profit
        maxProfit = Math.max(maxProfit, amount[node] + maxChildProfit);

        return amount[node] + maxChildProfit;
    }
}

