        for (int i = 1; i <= n; i++) {
            for (int j = 1; j <= k; j++) {
                for (int len = minLength; len <= i; len++) {
                    if (i - len < 0) break;
                    String sub = s.substring(i - len, i);
                    if (PRIME[sub.charAt(0) - '0'] && !PRIME[sub.charAt(len - 1) - '0']) {
                        dp[i][j] = (dp[i][j] + dp[i - len][j - 1]) % MOD;
