import java.util.*;

public class Solution {
    public int componentValue(int[] nums, int[][] edges) {
        int n = nums.length;
        List<Integer>[] graph = new ArrayList[n];
        for (int i = 0; i < n; i++) {
            graph[i] = new ArrayList<>();
        }

        for (int[] edge : edges) {
            graph[edge[0]].add(edge[1]);
            graph[edge[1]].add(edge[0]);
        }

        int totalSum = 0;
        for (int num : nums) {
            totalSum += num;
        }

        int maxEdgesDeleted = -1;

        for (int divisor = 1; divisor <= totalSum; divisor++) {
            if (totalSum % divisor == 0) {
                boolean[] visited = new boolean[n];
                int components = 0;

                for (int i = 0; i < n; i++) {
                    if (!visited[i]) {
                        int componentSum = dfs(nums, graph, visited, i);
                        if (componentSum % divisor != 0) {
                            break;
                        }
                        components += componentSum / divisor;
                    }
                }

                if (components == totalSum / divisor) {
                    maxEdgesDeleted = Math.max(maxEdgesDeleted, n - 1 - (totalSum / divisor));
                }
            }
        }

        return maxEdgesDeleted;
    }

    private int dfs(int[] nums, List<Integer>[] graph, boolean[] visited, int node) {
        if (visited[node]) {
            return 0;
        }

        visited[node] = true;

        int sum = nums[node];

        for (int neighbor : graph[node]) {
            sum += dfs(nums, graph, visited, neighbor);
        }

        return sum;
    }
}

