public class Solution {
    public int numberOfGoodPaths(int[] vals, int[][] edges) {
        Arrays.sort(edges, Comparator.comparingInt(a -> Math.max(vals[a[0]], vals[a[1]])));

        UnionFind uf = new UnionFind(vals.length);
        int result = 0;

        for (int[] edge : edges) {
            if (vals[edge[0]] == vals[edge[1]]) {
                int count0 = uf.getCount(edge[0]);
                int count1 = uf.getCount(edge[1]);
                uf.union(edge[0], edge[1]);
                result += count0 * count1;
            } else if (vals[edge[0]] < vals[edge[1]]) {
                break;
            }
        }

        return result + vals.length;
    }

    private static class UnionFind {
        int[] parent;
        int[] count;

        public UnionFind(int n) {
            parent = new int[n];
            count = new int[n];
            for (int i = 0; i < n; i++) {
                parent[i] = i;
                count[i] = 1;
            }
        }

        public void union(int x, int y) {
            int rootX = find(x);
            int rootY = find(y);
            if (rootX != rootY) {
                parent[rootY] = rootX;
                count[rootX] += count[rootY];
            }
        }

        public int find(int x) {
            if (parent[x] != x) {
                parent[x] = find(parent[x]);
            }
            return parent[x];
        }

        public int getCount(int x) {
            return count[find(x)];
        }
    }
}

