import java.util.*;

public class Solution {
    public int mostBooked(int n, int[][] meetings) {
        Arrays.sort(meetings, (a, b) -> a[0] - b[0]);

        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> a[1] == b[1] ? a[0] - b[0] : a[1] - b[1]);

        int[] roomCount = new int[n];
        for (int i = 0; i < n; i++) {
            pq.offer(new int[] {i, meetings[i][0]});
            roomCount[i]++;
        }

        int idx = n;
        for (; idx < meetings.length; idx++) {
            int[] earliestRoom = pq.poll();
            if (earliestRoom[1] <= meetings[idx][0]) {
                earliestRoom[1] = meetings[idx][1];
                pq.offer(earliestRoom);
                roomCount[earliestRoom[0]]++;
            } else {
                int delay = earliestRoom[1] - meetings[idx][0];
                meetings[idx][0] += delay;
                meetings[idx][1] += delay;
                earliestRoom[1] = meetings[idx][1];
                pq.offer(earliestRoom);
                roomCount[earliestRoom[0]]++;
            }
        }

        while (!pq.isEmpty()) {
            int[] room = pq.poll();
            roomCount[room[0]]++;
        }

        int maxMeetings = 0;
        for (int count : roomCount) {
            maxMeetings = Math.max(maxMeetings, count);
        }

        for (int i = 0; i < n; i++) {
            if (roomCount[i] == maxMeetings) {
                return i;
            }
        }

        return -1;
    }
}

