public class Solution {
    public boolean canEqualFrequency(String word) {
        Map<Character, Integer> frequency = new HashMap<>();

        // Count the frequency of each character
        for (char c : word.toCharArray()) {
            frequency.put(c, frequency.getOrDefault(c, 0) + 1);
        }

        // Check if removing one character can make all frequencies equal
        for (int i = 0; i < word.length(); i++) {
            char removedChar = word.charAt(i);
            Map<Character, Integer> newFrequency = new HashMap<>(frequency);
            newFrequency.put(removedChar, newFrequency.getOrDefault(removedChar, 1) - 1);

            if (newFrequency.get(removedChar) == 0) {
                newFrequency.remove(removedChar);
            }

            // Check if all frequencies are equal
            int expectedFrequency = -1;
            for (int count : newFrequency.values()) {
                if (expectedFrequency == -1) {
                    expectedFrequency = count;
                } else if (count != expectedFrequency) {
                    break;
                }
            }

            if (newFrequency.size() > 0 && expectedFrequency != -1 && newFrequency.values().stream().allMatch(count -> count == expectedFrequency)) {
                return true;
            }
        }

        return false;
    }
}

