public class Solution {
    public String[] splitMessage(String message, int limit) {
        int n = message.length();
        for (int k = 1; k <= n; k++) {
            int len = n + k * 9;
            if (len > limit * k) continue;
            if ((limit - 9) * k < n) continue;

            String[] res = new String[k];
            int start = 0, end = 0;
            for (int i = 1; i <= k; i++) {
                end += Math.min(limit - 9, n - start);
                if (i == k && end != n) return new String[0];

                res[i - 1] = message.substring(start, end) + "<" + i + "/" + k + ">";
