public class Solution {
    private static final int MOD = (int) 1e9 + 7;

    public int countPalindromes(String s) {
        int n = s.length();
        long[][][] dp = new long[n][n][10];

        for (int i = 0; i < n; i++) {
            dp[i][i][s.charAt(i) - '0'] = 1;
        }

        for (int length = 2; length <= n; length++) {
            for (int left = 0; left <= n - length; left++) {
                int right = left + length - 1;

                for (int firstDigit = 0; firstDigit < 10; firstDigit++) {
                    for (int lastDigit = 0; lastDigit < 10; lastDigit++) {
                        if (firstDigit == lastDigit) {
                            long count = 0;

                            // Count the number of subsequences where the first and last digits are equal
                            for (int k = left + 1; k <= right - 1; k++) {
                                count += dp[left + 1][k - 1][firstDigit] * dp[k][right - 1][lastDigit];
                                count %= MOD;
                            }

                            // Add the count to the total number of palindromic subsequences
                            if (s.charAt(left) == firstDigit + '0' && s.charAt(right) == lastDigit + '0') {
                                dp[left][right][firstDigit] += count % MOD;
                                dp[left][right][firstDigit] %= MOD;
                            }
                        }
                    }
                }
            }
        }

        long result = 0;
        for (int i = 0; i < 10; i++) {
            result += dp[0][n - 1][i];
            result %= MOD;
        }

        return (int) result;
    }
}

