public class Solution {
    public long minimumTotalCost(int[] nums1, int[] nums2) {
        Map<Integer, List<Integer>> map = new HashMap<>();
        for (int i = 0; i < nums1.length; i++) {
            if (!map.containsKey(nums1[i])) {
                map.put(nums1[i], new ArrayList<>());
            }
            map.get(nums1[i]).add(i);
        }

        long cost = 0;
        boolean[] swapped = new boolean[nums1.length];
        for (int i = 0; i < nums1.length; i++) {
            if (nums1[i] == nums2[i]) {
                List<Integer> indices = map.get(nums1[i]);
                int j = -1;
                long minCost = Long.MAX_VALUE;
                for (Integer index : indices) {
                    if (!swapped[index] && index != i) {
                        long currentCost = index + i;
                        if (currentCost < minCost) {
                            minCost = currentCost;
                            j = index;
                        }
                    }
                }

                if (j == -1) {
                    return -1; // no possible swap
                }

                cost += minCost;
                swapped[i] = true;
                swapped[j] = true;

                int temp = nums1[i];
                nums1[i] = nums1[j];
                nums1[j] = temp;
            }
        }

        return cost;
    }
}

