            for (int j = 0; j <= n; j++) {
                dp[i][j] = Integer.MAX_VALUE;
            }
        }

        dp[0][0] = 0;

        for (int i = 1; i <= n; i++) {
            int ports = 0, weight = 0;
            for (int j = i; j > 0; j--) {
                if (i - j + 1 > maxBoxes || prefixSum[i] - prefixSum[j - 1] > maxWeight) break;

                weight += boxes[j - 1][1];
                if (j < i && boxes[j - 1][0] != boxes[j][0]) ports++;

                dp[i][j] = Math.min(dp[i][j], dp[j - 1][0] + ports + 2);
            }
        }

        return dp[n][n];
    }
}

