// #2022_04_23_Time_7_ms_(94.23%)_Space_75.4_MB_(73.08%)
import java.util.*;

public class Solution {
    public boolean canDistribute(int[] nums, int[] quantity) {
        Map<Integer, Integer> count = new HashMap<>();
        for (int num : nums) {
            count.put(num, count.getOrDefault(num, 0) + 1);
        }

        List<Map.Entry<Integer, Integer>> list = new ArrayList<>(count.entrySet());
        Collections.sort(list, (a, b) -> b.getValue().compareTo(a.getValue()));

        int[] masks = new int[quantity.length];
        for (int i = 0; i < quantity.length; i++) {
            masks[i] = (1 << i);
        }

        return dfs(0, list, quantity, masks, 0);
    }

    private boolean dfs(int index, List<Map.Entry<Integer, Integer>> list, int[] quantity, int[] masks, int state) {
        if (index == list.size()) {
            for (int mask : masks) {
                if ((state & mask) != mask) {
                    return false;
                }
            }
            return true;
        }

        Map.Entry<Integer, Integer> entry = list.get(index);
        int num = entry.getKey();
        int count = entry.getValue();

        boolean possible = dfs(index + 1, list, quantity, masks, state);

        if (!possible) {
            for (int i = 0; i < quantity.length; i++) {
                if ((state & masks[i]) == 0 && count >= quantity[i]) {
                    count -= quantity[i];
                    state |= masks[i];
                    possible = dfs(index, list, quantity, masks, state);
                    if (possible) {
                        return true;
                    }
                    count += quantity[i];
                    state ^= masks[i];
                }
            }
        }

        return possible;
    }
}

