import java.util.Arrays;
public class Solution {
    public int minimumIncompatibility(int[] nums, int k) {
        int n = nums.length;
        if (n % k != 0) return -1;

        Arrays.sort(nums);
        int subsetSize = n / k;
        int[][] subsets = new int[k][subsetSize];
        boolean[] used = new boolean[n];

        for (int i = 0; i < k; i++) {
            for (int j = 0; j < subsetSize; j++) {
                int index = findUnused(nums, used);
                if (index == -1) return -1;
                subsets[i][j] = nums[index];
                used[index] = true;
            }
        }

        int sumOfIncompatibilities = 0;
        for (int i = 0; i < k; i++) {
            Arrays.sort(subsets[i]);
            if (!isValidSubset(subsets[i])) return -1;
            sumOfIncompatibilities += subsets[i][subsetSize - 1] - subsets[i][0];
        }

        return sumOfIncompatibilities;
    }

    private int findUnused(int[] nums, boolean[] used) {
        for (int i = 0; i < nums.length; i++) {
            if (!used[i]) return i;
        }
        return -1;
    }

    private boolean isValidSubset(int[] subset) {
        for (int i = 1; i < subset.length; i++) {
            if (subset[i] == subset[i - 1]) return false;
        }
        return true;
    }
}

