public class Solution {
    public int[][] matrixRankTransform(int[][] matrix) {
        if (matrix.length == 0 || matrix[0].length == 0) return new int[0][0];

        int m = matrix.length, n = matrix[0].length;
        int[][] res = new int[m][n];
        Map<Integer, List<int[]>> map = new HashMap<>();

        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (!map.containsKey(matrix[i][j])) {
                    map.put(matrix[i][j], new ArrayList<>());
                }
                map.get(matrix[i][j]).add(new int[] {i, j});
            }
        }

        Arrays.sort(matrix[0]);

        for (int i = 1; i < m; i++) {
            Arrays.sort(matrix[i]);
        }

        List<Integer> sortedVals = new ArrayList<>(map.keySet());
        Collections.sort(sortedVals);

        for (Integer val : sortedVals) {
            List<int[]> cells = map.get(val);
            int[] maxRankRow = new int[m];
            int[] maxRankCol = new int[n];

            for (int[] cell : cells) {
                maxRankRow[cell[0]] = Math.max(maxRankRow[cell[0]], res[cell[0]][cell[1]]);
                maxRankCol[cell[1]] = Math.max(maxRankCol[cell[1]], res[cell[0]][cell[1]]);
            }

            int rank = 1;
            for (int[] cell : cells) {
                if (res[cell[0]][cell[1]] == 0) {
                    res[cell[0]][cell[1]] = Math.max(maxRankRow[cell[0]], maxRankCol[cell[1]]) + 1;
                    rank = Math.max(rank, res[cell[0]][cell[1]]);
                }
            }

            for (int[] cell : cells) {
                if (res[cell[0]][cell[1]] == 0) {
                    res[cell[0]][cell[1]] = rank;
                }
            }
        }

        return res;
    }
