                boolean[] visited = new boolean[n];
                Queue<int[]> queue = new LinkedList<>();
                queue.offer(new int[]{i, 0});
                visited[i] = true;

                while (!queue.isEmpty()) {
                    int[] current = queue.poll();
                    maxDistance = Math.max(maxDistance, current[1]);
                    for (int neighbor : graph[current[0]]) {
                        if ((mask & (1 << neighbor)) != 0 && !visited[neighbor]) {
                            queue.offer(new int[]{neighbor, current[1] + 1});
                            visited[neighbor] = true;
                        }
                    }
                }
            }

            // Update the result
            if (maxDistance > 0) {
                result[maxDistance - 1]++;
            }
        }

