public class Solution {
    public int maxResult(int[] nums, int k) {
        Deque<int[]> deque = new ArrayDeque<>();
        int n = nums.length;
        for (int i = 0; i < n; i++) {
            while (!deque.isEmpty() && deque.peekFirst()[1] < i - k) {
                deque.pollFirst();
            }
            int maxScore = deque.isEmpty() ? 0 : deque.peekFirst()[0];
            int score = maxScore + nums[i];
            while (!deque.isEmpty() && deque.peekLast()[0] <= score) {
