import java.util.ArrayList;
import java.util.Collections;
import java.util.List;

public class Solution {
    public int visiblePoints(List<List<Integer>> points, int angle, List<Integer> location) {
        int sameLocation = 0;
        List<Double> angles = new ArrayList<>();

        for (List<Integer> point : points) {
            if (point.get(0).equals(location.get(0)) && point.get(1).equals(location.get(1))) {
                sameLocation++;
            } else {
                double angleInDegrees = Math.toDegrees(Math.atan2(point.get(1) - location.get(1), point.get(0) - location.get(0)));
                if (angleInDegrees < 0) {
                    angleInDegrees += 360;
                }
                angles.add(angleInDegrees);
            }
        }

        Collections.sort(angles);

        int maxVisible = sameLocation;
        int left = 0, right = 0;
        double[] angleArray = new double[angles.size()];
        for (int i = 0; i < angles.size(); i++) {
            angleArray[i] = angles.get(i);
        }

        while (left <= right && right < angles.size()) {
            if (angleArray[right] - angleArray[left] <= angle) {
                maxVisible = Math.max(maxVisible, right - left + 1 + sameLocation);
                right++;
            } else {
                left++;
            }
        }

        // Check for the case where the angle wraps around
        int i = 0;
        while (i < angles.size() && angles.get(i) <= angleArray[angles.size() - 1] - angle) {
            maxVisible = Math.max(maxVisible, i + 1 + sameLocation);
            i++;
        }

        return maxVisible;
    }
}

