public class Solution {
    public int[] bestCoordinate(int[][] towers, int radius) {
        int maxX = 0;
        int maxY = 0;

        // Find the maximum x and y coordinates of all towers
        for (int[] tower : towers) {
            maxX = Math.max(maxX, tower[0]);
            maxY = Math.max(maxY, tower[1]);
        }

        int maxQuality = 0;
        int[] bestCoordinate = new int[] {0, 0};

        // Iterate over all possible coordinates
        for (int x = 0; x <= maxX; x++) {
            for (int y = 0; y <= maxY; y++) {
                int quality = 0;

                // Calculate the signal quality at the current coordinate
                for (int[] tower : towers) {
                    double distance = Math.sqrt(Math.pow(x - tower[0], 2) + Math.pow(y - tower[1], 2));

                    if (distance <= radius) {
                        quality += (int) Math.floor(tower[2] / (1 + distance));
                    }
                }

                // Update the best coordinate if the current coordinate has a higher signal quality
                if (quality > maxQuality || (quality == maxQuality && (x < bestCoordinate[0] || x == bestCoordinate[0] && y < bestCoordinate[1]))) {
                    maxQuality = quality;
                    bestCoordinate[0] = x;
                    bestCoordinate[1] = y;
                }
            }
        }

        return bestCoordinate;
    }
