    public int countStudents(int[] students, int[] sandwiches) {
        Queue<Integer> studentQueue = new LinkedList<>();

        // Initialize the queue with student preferences
        for (int preference : students) {
            studentQueue.offer(preference);
        }

        // Iterate over the sandwiches
        for (int sandwichType : sandwiches) {
            boolean foundMatch = false;

            // Check if there are any students who prefer this type of sandwich
            while (!studentQueue.isEmpty() && studentQueue.peek() != sandwichType) {
