public class Solution {
    public int stoneGameVII(int[] stones) {
        int n = stones.length;
        int[][] dp = new int[n][n];

        // Calculate prefix sum for the array
        int[] prefixSum = new int[n + 1];
        for (int i = 0; i < n; i++) {
            prefixSum[i + 1] = prefixSum[i] + stones[i];
        }

        // Fill dp table in a bottom-up manner
        for (int length = 2; length <= n; length++) {
            for (int left = 0; left <= n - length; left++) {
                int right = left + length - 1;

                // Calculate the score if Alice takes the leftmost stone
                int takeLeft = prefixSum[right + 1] - prefixSum[left + 1];
                if (left + 2 <= right) {
                    takeLeft -= dp[left + 1][right];
                }

                // Calculate the score if Alice takes the rightmost stone
                int takeRight = prefixSum[right] - prefixSum[left];
                if (left <= right - 2) {
                    takeRight -= dp[left][right - 1];
                }

                // Update dp table with the maximum possible score for Alice
                dp[left][right] = Math.max(takeLeft, takeRight);
            }
        }

        return dp[0][n - 1];
    }
}

