public class Solution {
    public List<Integer> busiestServers(int k, int[] arrival, int[] load) {
        PriorityQueue<int[]> busy = new PriorityQueue<>((a, b) -> a[1] - b[1]);
        TreeSet<Integer> available = new TreeSet<>();
        for (int i = 0; i < k; i++) {
            available.add(i);
        }

        int[] requestCount = new int[k];
        for (int i = 0, n = arrival.length; i < n; i++) {
            while (!busy.isEmpty() && busy.peek()[1] <= arrival[i]) {
                available.add(busy.poll()[0]);
            }

            if (available.isEmpty()) continue;

            Integer next = available.ceiling(i % k);
            if (next == null) next = available.first();

            requestCount[next]++;
            busy.offer(new int[] {next, arrival[i] + load[i]});
            available.remove(next);
        }

        int maxRequest = 0;
        for (int count : requestCount) {
            maxRequest = Math.max(maxRequest, count);
        }

        List<Integer> result = new ArrayList<>();
        for (int i = 0; i < k; i++) {
            if (requestCount[i] == maxRequest) {
                result.add(i);
            }
        }

        return result;
    }

