        int target = 0;
        for (int num : nums) {
            target += num;
        }
        target -= x;

        if (target < 0) return -1;

        int left = 0, maxLength = Integer.MIN_VALUE;
        int currentSum = 0;

        for (int right = 0; right < nums.length; right++) {
            currentSum += nums[right];

            while (currentSum > target && left <= right) {
