import java.util.Arrays;

public class Solution {
    private static final int MOD = (int) 1e9 + 7;

    public int maxProfit(int[] inventory, int orders) {
        Arrays.sort(inventory);
        long res = 0;

        for (int i = 0; i < inventory.length && orders > 0; i++) {
            if (i == 0 || inventory[i] != inventory[i - 1]) {
                int count = 1;
                while (i + 1 < inventory.length && inventory[i] == inventory[i + 1]) {
                    i++;
                    count++;
                }

                long sell = Math.min(orders, inventory[i]);
                res += calculateProfit(inventory[i], sell);
                orders -= sell;
            }
        }

        return (int) (res % MOD);
    }

    private long calculateProfit(int balls, int sell) {
        long sum = 0;
        for (int i = balls; i > balls - sell; i--) {
            sum += i;
        }
        return sum;
    }
}

