public class Solution {
    public int maximalNetworkRank(int n, int[][] roads) {
        Map<Integer, Set<Integer>> graph = new HashMap<>();

        // Initialize the graph
        for (int i = 0; i < n; i++) {
            graph.put(i, new HashSet<>());
        }

        // Build the graph
        for (int[] road : roads) {
            int a = road[0];
            int b = road[1];
            graph.get(a).add(b);
            graph.get(b).add(a);
        }

        int maxRank = 0;

        // Calculate the network rank for each pair of cities
        for (int i = 0; i < n; i++) {
            for (int j = i + 1; j < n; j++) {
                Set<Integer> connectedCities = new HashSet<>();
                connectedCities.addAll(graph.get(i));
                connectedCities.addAll(graph.get(j));

                // Remove the cities themselves from the set
                connectedCities.remove(i);
                connectedCities.remove(j);

                int rank = graph.get(i).size() + graph.get(j).size() - (graph.get(i).contains(j) ? 1 : 0);
                maxRank = Math.max(maxRank, rank);
            }
        }

        return maxRank;
    }
}

