        int zeros = 0;
        int ones = 0;
        char prevChar = ' ';
        for (char c : s.toCharArray()) {
            if (prevChar != ' ' && prevChar != c) {
                if ((c == '1' && zeros > 0) || (c == '0' && ones > 0)) {
                    continue;
                } else {
                    return false;
                }
            }
            if (c == '0') {
                zeros++;
            } else {
                ones++;
            }
            prevChar = c;
        }
        return zeros == ones && zeros != 0;
    }
}

