import java.util.HashMap;
import java.util.HashSet;

public class Solution {
    public int minStickers(String[] stickers, String target) {
        int n = target.length();
        int[] dp = new int[1 << n];
        for (int i = 0; i < dp.length; i++) {
            dp[i] = -1;
        }
        dp[0] = 0;

        HashMap<Character, HashSet<Integer>> map = new HashMap<>();
        for (int i = 0; i < stickers.length; i++) {
            String sticker = stickers[i];
            for (char c : sticker.toCharArray()) {
                if (!map.containsKey(c)) {
                    map.put(c, new HashSet<>());
                }
                map.get(c).add(i);
            }
        }

        for (int mask = 0; mask < dp.length; mask++) {
            if (dp[mask] == -1) continue;
            for (char c : target.toCharArray()) {
                int indexSet = getBitIndex(mask, c, target, stickers, map);
                if (indexSet != -1) {
                    for (int index : indexSet) {
                        String sticker = stickers[index];
                        int newMask = mask;
                        for (char ch : sticker.toCharArray()) {
                            if (ch == c && (newMask & (1 << target.indexOf(c))) == 0) {
                                newMask |= (1 << target.indexOf(ch));
                            } else if ((newMask & (1 << target.indexOf(ch))) == 0) {
                                newMask |= (1 << target.indexOf(ch));
                            }
                        }
                        dp[newMask] = Math.max(dp[newMask], dp[mask] + 1);
                    }
                }
            }
        }

        int result = -1;
        for (int i = 0; i < dp.length; i++) {
            if ((i & (i + 1)) == 0) {
                if (dp[i] != -1 && (result == -1 || dp[i] < result)) {
                    result = dp[i];
                }
            }
        }

        return result;
    }

    private HashSet<Integer> getBitIndex(int mask, char c, String target, String[] stickers, HashMap<Character, HashSet<Integer>> map) {
        HashSet<Integer> indexSet = new HashSet<>();
        for (int i : map.getOrDefault(c, new HashSet<>())) {
            if ((mask & (1 << target.indexOf(c))) == 0) {
                indexSet.add(i);
            }
        }
        return indexSet.isEmpty() ? null : indexSet;
    }
}

