public class Solution {
    public int maxDepth(String s) {
        Deque<Character> stack = new ArrayDeque<>();
        int maxDepth = 0, currentDepth = 0;

        for (char c : s.toCharArray()) {
            if (c == '(') {
                stack.push(c);
                currentDepth++;
                maxDepth = Math.max(maxDepth, currentDepth);
            } else if (c == ')') {
                if (!stack.isEmpty()) {
                    stack.pop();
                    currentDepth--;
                }
            }
        }

        return maxDepth;
    }
}

