public class Solution {
    public int[] maxSumOfThreeSubarrays(int[] nums, int k) {
        int n = nums.length;
        int[] sum = new int[n + 1];
        for (int i = 0; i < n; i++) {
            sum[i + 1] = sum[i] + nums[i];
        }

        int maxSum = Integer.MIN_VALUE;
        int[] result = new int[3];

        for (int firstStart = 0; firstStart <= n - 3 * k; firstStart++) {
            int firstEnd = firstStart + k - 1;
            int firstSum = sum[firstEnd + 1] - sum[firstStart];

            for (int secondStart = firstEnd + 1; secondStart <= n - 2 * k; secondStart++) {
                int secondEnd = secondStart + k - 1;
                int secondSum = sum[secondEnd + 1] - sum[secondStart];

                for (int thirdStart = secondEnd + 1; thirdStart <= n - k; thirdStart++) {
                    int thirdEnd = thirdStart + k - 1;
                    int thirdSum = sum[thirdEnd + 1] - sum[thirdStart];

                    if (firstSum + secondSum + thirdSum > maxSum) {
                        maxSum = firstSum + secondSum + thirdSum;
                        result[0] = firstStart;
                        result[1] = secondStart;
                        result[2] = thirdStart;
                    } else if (firstSum + secondSum + thirdSum == maxSum) {
                        int[] currentResult = {firstStart, secondStart, thirdStart};
                        for (int i = 0; i < 3; i++) {
                            if (currentResult[i] < result[i]) {
                                result[0] = firstStart;
                                result[1] = secondStart;
                                result[2] = thirdStart;
                                break;
                            } else if (currentResult[i] > result[i]) {
                                break;
                            }
                        }
                    }
                }
            }
        }

        return result;
    }
}

