public class Solution {
    private static final int MOD = (int) 1e9 + 7;

    public int numDecodings(String s) {
        int n = s.length();
        long[] dp = new long[n + 1];

        // Base case: there is one way to decode an empty string
        dp[0] = 1;

        if (s.charAt(0) != '0') {
            dp[1] = 1;
        }

        for (int i = 2; i <= n; i++) {
            // If the current character is not zero, we can decode it separately
            if (s.charAt(i - 1) != '0') {
                dp[i] += dp[i - 1];
            }

            // If the last two characters are between 10 and 26, we can decode them together
            if (s.charAt(i - 2) == '1' || (s.charAt(i - 2) == '2' && s.charAt(i - 1) <= '6')) {
                dp[i] += dp[i - 2];
            }

            // If the current character is '*', we can replace it with any digit from 1 to 9
            if (s.charAt(i - 1) == '*') {
                dp[i] = (dp[i] + 9 * dp[i - 1]) % MOD;

                // If the last two characters are '1*' or '2*', we can decode them together
                if (i >= 2 && s.charAt(i - 2) == '1') {
                    dp[i] = (dp[i] + 9 * dp[i - 2]) % MOD;
                } else if (i >= 2 && s.charAt(i - 2) == '2') {
                    dp[i] = (dp[i] + 6 * dp[i - 2]) % MOD;
                }
            }

            // If the last two characters are '*0' or '**', we can decode them together
            if (i >= 2 && s.charAt(i - 2) == '*' && s.charAt(i - 1) != '0') {
                dp[i] = (dp[i] + 2 * dp[i - 2]) % MOD;
            }

            // If the last two characters are '*0', we can decode them together
            if (i >= 2 && s.charAt(i - 2) == '*' && s.charAt(i - 1) == '0') {
                dp[i] = (dp[i] + dp[i - 2]) % MOD;
            }

            // If the last two characters are '**', we can decode them together
            if (i >= 2 && s.charAt(i - 2) == '*' && s.charAt(i - 1) == '*') {
                dp[i] = (dp[i] + 15 * dp[i - 2]) % MOD;
            }
        }

        return (int) dp[n];
    }
}

