                newCards[index] = (int) (a * b);
                newCards[index + 1] = (int) (b / a);
                if (dfs(newCards, index + 1)) return true;

                newCards[index] = (int) (a - b);
                newCards[index + 1] = (int) (a / b);
                if (dfs(newCards, index + 1)) return true;
            }
        }

