public class Solution {
    public int[] fallingSquares(int[][] positions) {
        int n = positions.length;
        int[] ans = new int[n];
        int[] heights = new int[n];

        for (int i = 0; i < n; i++) {
            int x = positions[i][0], sideLength = positions[i][1];
            int y = 0;

            for (int j = 0; j < i; j++) {
                if (positions[j][0] < x + sideLength && positions[j][0] + positions[j][1] > x) {
                    y = Math.max(y, heights[j]);
                }
            }

            heights[i] = y + sideLength;
            int max = 0;

            for (int height : heights) {
                if (height > max) {
                    max = height;
                }
            }

            ans[i] = max;
