    public int flipLights(int n, int presses) {
        if (n == 0 || presses == 0) return 1;
        if (n == 1) return presses > 0 ? 2 : 1;
        if (n == 2) return presses > 1 ? 4 : Math.min(presses + 1, 3);
        if (presses >= 3) return 8;
        int[] masks = {15, 9, 10, 6};
