public class Solution {
    public String solveEquation(String equation) {
        int leftX = 0, rightX = 0;
        int leftVal = 0, rightVal = 0;
        boolean leftHasX = false, rightHasX = false;

        String[] parts = equation.split("=");

        // Parse the left side of the equation
        String[] tokens = parts[0].split("(?=[+-])");
        for (String token : tokens) {
            if (token.contains("x")) {
                leftHasX = true;
                if (token.equals("+x") || token.equals("x")) {
                    leftX++;
                } else if (token.equals("-x")) {
                    leftX--;
                } else {
                    int coeff = Integer.parseInt(token.replace("x", "").replace("+", ""));
                    if (coeff < 0) {
                        leftX -= coeff;
                    } else {
                        leftX += coeff;
                    }
                }
            } else {
                int val = Integer.parseInt(token);
                leftVal += val;
            }
        }

        // Parse the right side of the equation
        tokens = parts[1].split("(?=[+-])");
        for (String token : tokens) {
            if (token.contains("x")) {
                rightHasX = true;
                if (token.equals("+x") || token.equals("x")) {
                    rightX++;
                } else if (token.equals("-x")) {
                    rightX--;
                } else {
                    int coeff = Integer.parseInt(token.replace("x", "").replace("+", ""));
                    if (coeff < 0) {
                        rightX -= coeff;
                    } else {
                        rightX += coeff;
                    }
                }
            } else {
                int val = Integer.parseInt(token);
                rightVal += val;
            }
        }

        // Calculate the solution
        leftX -= rightX;
        rightVal -= leftVal;

        if (leftX == 0 && rightVal != 0) {
            return "No solution";
        } else if (leftX == 0 && rightVal == 0) {
            return "Infinite solutions";
        }

        int x = rightVal / leftX;
        return "x=" + x;
    }
}

