public class Solution {
    public int[] findRedundantDirectedConnection(int[][] edges) {
        int n = edges.length;
        int[] parent = new int[n + 1];

        // Find the node with two parents
        int[] candidate1 = null, candidate2 = null;
        for (int[] edge : edges) {
            if (parent[edge[1]] != 0) {
                candidate1 = new int[] {parent[edge[1]], edge[1]};
                candidate2 = edge;
            } else {
                parent[edge[1]] = edge[0];
            }
        }

        // If no node has two parents, then the last edge is the redundant one
        if (candidate1 == null) {
            return edges[n - 1];
        }

        // Check if removing candidate2 will make the graph a tree
        int[] root = new int[n + 1];
        for (int i = 1; i <= n; i++) {
            root[i] = i;
        }

        for (int[] edge : edges) {
            if (edge == candidate2) continue;
            int x = find(root, edge[0]);
            int y = find(root, edge[1]);
            if (x == y) return candidate2;
            root[x] = y;
        }

        // If removing candidate2 does not work, then remove candidate1
        return candidate1;
    }

    private int find(int[] root, int x) {
        if (root[x] != x) {
            root[x] = find(root, root[x]);
        }
        return root[x];
    }
}

