    private double knightProbabilityMemo(int n, int k, int row, int column) {
        Double[][][] memo = new Double[n][n][k + 1];
        return dfsMemo(n, k, row, column, memo);
    }

    private double dfsMemo(int n, int k, int row, int column, Double[][][] memo) {
        if (row < 0 || row >= n || column < 0 || column >= n) {
            return 0;
        }
        if (k == 0) {
            return 1;
        }
        if (memo[row][column][k] != null) {
            return memo[row][column][k];
        }
        double probability = 0;
        for (int[] direction : DIRECTIONS) {
            int newRow = row + direction[0];
            int newColumn = column + direction[1];
            probability += dfsMemo(n, k - 1, newRow, newColumn, memo);
        }
        memo[row][column][k] = probability / 8.0;
        return memo[row][column][k];
    }
}

