import java.util.*;

public class Solution {
    private static final int[][] DIRECTIONS = {{-1, 0}, {1, 0}, {0, -1}, {0, 1}};

    public int cutOffTree(List<List<Integer>> forest) {
        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> a[2] - b[2]);

        for (int i = 0; i < forest.size(); i++) {
            for (int j = 0; j < forest.get(0).size(); j++) {
                if (forest.get(i).get(j) > 1) {
                    pq.offer(new int[] {i, j, forest.get(i).get(j)});
                }
            }
        }

        int steps = 0;
        int[] start = new int[] {0, 0};

        while (!pq.isEmpty()) {
            int[] tree = pq.poll();
            int dist = bfs(forest, start, tree);

            if (dist == -1) return -1;

            steps += dist;
            start = tree;
        }

        return steps;
    }

    private int bfs(List<List<Integer>> forest, int[] start, int[] end) {
        Queue<int[]> queue = new LinkedList<>();
        boolean[][] visited = new boolean[forest.size()][forest.get(0).size()];

        queue.offer(new int[] {start[0], start[1], 0});
        visited[start[0]][start[1]] = true;

        while (!queue.isEmpty()) {
            int[] curr = queue.poll();

            if (curr[0] == end[0] && curr[1] == end[1]) return curr[2];

            for (int[] dir : DIRECTIONS) {
                int x = curr[0] + dir[0], y = curr[1] + dir[1];

                if (x >= 0 && x < forest.size() && y >= 0 && y < forest.get(0).size()
                        && !visited[x][y] && forest.get(x).get(y) != 0) {
                    queue.offer(new int[] {x, y, curr[2] + 1});
                    visited[x][y] = true;
                }
            }
        }

        return -1;
    }
}

