public class Solution {
    public boolean isPossible(int[] nums) {
        Map<Integer, Integer> frequencyMap = new HashMap<>();
        Map<Integer, Integer> sequenceMap = new HashMap<>();

        // Count the frequency of each number
        for (int num : nums) {
            frequencyMap.put(num, frequencyMap.getOrDefault(num, 0) + 1);
        }

        // Try to form sequences
        for (int num : nums) {
            if (frequencyMap.get(num) == 0) {
                continue;
            }
            frequencyMap.put(num, frequencyMap.get(num) - 1);

            // Check if we can append the current number to an existing sequence
            if (sequenceMap.containsKey(num)) {
                sequenceMap.put(num, sequenceMap.get(num) - 1);
                sequenceMap.put(num + 1, sequenceMap.getOrDefault(num + 1, 0) + 1);
            } else {
                // If not, try to form a new sequence
                if (frequencyMap.containsKey(num + 1) && frequencyMap.containsKey(num + 2)) {
                    frequencyMap.put(num + 1, frequencyMap.get(num + 1) - 1);
                    frequencyMap.put(num + 2, frequencyMap.get(num + 2) - 1);
                    sequenceMap.put(num + 3, sequenceMap.getOrDefault(num + 3, 0) + 1);
                } else {
                    return false;
                }
            }
        }

        return true;
    }
}

