// #2022_03_22_Time_24_ms_(85.43%)_Space_51.3_MB_(21.34%)
import java.util.Arrays;

public class Solution {
    public boolean canPartitionKSubsets(int[] nums, int k) {
        int sum = 0;
        for (int num : nums) {
            sum += num;
        }

        if (sum % k != 0) return false;

        int target = sum / k;
        Arrays.sort(nums);
        reverseArray(nums);

        boolean[] visited = new boolean[nums.length];

        return backtrack(0, k, 0, nums, target, visited);
    }

    private boolean backtrack(int start, int k, int currentSum, int[] nums, int target, boolean[] visited) {
        if (k == 0) return true;

        for (int i = start; i < nums.length; i++) {
            if (!visited[i] && currentSum + nums[i] <= target) {
                visited[i] = true;

                if (backtrack(i + 1, k - (currentSum + nums[i] == target ? 1 : 0), 
                             (currentSum + nums[i]) % target, nums, target, visited)) {
                    return true;
                }

                visited[i] = false;
            }
        }

        return false;
    }

    private void reverseArray(int[] array) {
        int left = 0;
        int right = array.length - 1;

        while (left < right) {
            int temp = array[left];
            array[left] = array[right];
            array[right] = temp;

            left++;
            right--;
        }
    }
}

