                // Check the surrounding cells
                for (int x = -1; x <= 1; x++) {
                    for (int y = -1; y <= 1; y++) {
                        if (x == 0 && y == 0) continue;
                        int newRow = i + x;
                        int newCol = j + y;

                        // Check if the surrounding cell is within the matrix
                        if (newRow >= 0 && newRow < m && newCol >= 0 && newCol < n) {
                            sum += matrix[newRow][newCol];
                            count++;
                        }
                    }
                }

                // Calculate the average and round down
                result[i][j] = sum / count;
            }
        }

        return result;
    }
}

