public class Solution {
    public int widthOfBinaryTree(TreeNode root) {
        if (root == null) return 0;

        int maxWidth = 0;
        Queue<Pair> queue = new LinkedList<>();
        queue.offer(new Pair(root, 0));

        while (!queue.isEmpty()) {
            int levelSize = queue.size();
            int minIdx = queue.peek().idx;
            int maxIdx = queue.peek().idx;

            for (int i = 0; i < levelSize; i++) {
                Pair pair = queue.poll();
                maxIdx = Math.max(maxIdx, pair.idx);
                if (pair.node.left != null) {
                    queue.offer(new Pair(pair.node.left, 2 * pair.idx + 1));
                }
                if (pair.node.right != null) {
                    queue.offer(new Pair(pair.node.right, 2 * pair.idx + 2));
                }
            }

            maxWidth = Math.max(maxWidth, maxIdx - minIdx + 1);
        }

        return maxWidth;
    }

    public class Solution {
        TreeNode node;
        int idx;

        public Pair(TreeNode node, int idx) {
            this.node = node;
            this.idx = idx;
        }
