public class Solution {
    public int maxProfit(int k, int[] prices) {
        int n = prices.length;
        if (n < 2) return 0;

        // If the number of transactions is more than or equal to half of the days,
        // we can simply consider every peak and valley in the price array.
        if (k >= n / 2) {
            int maxProfit = 0;
            for (int i = 1; i < n; i++) {
                if (prices[i] > prices[i - 1]) {
                    maxProfit += prices[i] - prices[i - 1];
                }
            }
            return maxProfit;
        }

        // Initialize a 2D array to store the maximum profit for each subproblem.
        int[][] dp = new int[n][k + 1];

        // Iterate over each day and each possible number of transactions.
        for (int i = 1; i < n; i++) {
            for (int j = 1; j <= k; j++) {
                // Initialize the maximum profit to be the same as the previous day.
                int maxProfit = dp[i - 1][j];

                // Iterate over each previous day to find the maximum profit if we sell on the current day.
                for (int l = 0; l < i; l++) {
                    // Update the maximum profit if selling on the current day gives a higher profit.
                    maxProfit = Math.max(maxProfit, dp[l][j - 1] + prices[i] - prices[l]);
                }

                // Update the maximum profit for the current subproblem.
                dp[i][j] = maxProfit;
            }
        }

        // Return the maximum profit for the last day and the given number of transactions.
        return dp[n - 1][k];
    }
}

