public class Solution {
    public List<List<Integer>> pathSum(TreeNode root, int targetSum) {
        List<List<Integer>> result = new ArrayList<>();
        dfs(root, targetSum, new ArrayList<>(), 0, result);
        return result;
    }

    private void dfs(TreeNode node, int targetSum, List<Integer> currentPath, int currentSum, List<List<Integer>> result) {
        if (node == null) {
            return;
        }

        currentPath.add(node.val);
        currentSum += node.val;

        if (node.left == null && node.right == null && currentSum == targetSum) {
            result.add(new ArrayList<>(currentPath));
        }

        dfs(node.left, targetSum, currentPath, currentSum, result);
        dfs(node.right, targetSum, currentPath, currentSum, result);

        currentPath.remove(currentPath.size() - 1);
    }
}

