public class Solution {
    public int maxPoints(int[][] points) {
        if (points.length <= 2) return points.length;

        int n = points.length;
        int maxPoints = 0;

        for (int i = 0; i < n; i++) {
            Map<Double, Integer> slopeMap = new HashMap<>();
            int samePoint = 1;

            for (int j = i + 1; j < n; j++) {
                if (points[i][0] == points[j][0] && points[i][1] == points[j][1]) {
                    samePoint++;
                    continue;
                }

                double slope = calculateSlope(points[i], points[j]);
                slopeMap.put(slope, slopeMap.getOrDefault(slope, 0) + 1);
            }

            maxPoints = Math.max(maxPoints, getMaxValueFromMap(slopeMap) + samePoint);
        }

        return maxPoints;
    }

    private double calculateSlope(int[] point1, int[] point2) {
        int xDiff = point2[0] - point1[0];
        int yDiff = point2[1] - point1[1];

        if (xDiff == 0) return Double.POSITIVE_INFINITY;

        return (double) yDiff / xDiff;
    }

    private int getMaxValueFromMap(Map<Double, Integer> map) {
        int max = 0;
        for (int value : map.values()) {
            max = Math.max(max, value);
        }
        return max;
    }
}

