import java.util.Map;

public class Solution {
    public TreeNode buildTree(int[] preorder, int[] inorder) {
        Map<Integer, Integer> indexMap = new HashMap<>();
        for (int i = 0; i < inorder.length; i++) {
            indexMap.put(inorder[i], i);
        }

        return buildTree(preorder, 0, preorder.length - 1, 
                         inorder, 0, inorder.length - 1, indexMap);
    }

    private TreeNode buildTree(int[] preorder, int preStart, int preEnd, 
                               int[] inorder, int inStart, int inEnd, Map<Integer, Integer> indexMap) {
        if (preStart > preEnd || inStart > inEnd) return null;

        TreeNode root = new TreeNode(preorder[preStart]);
        int index = indexMap.get(root.val);

        int leftSize = index - inStart;

        root.left = buildTree(preorder, preStart + 1, preStart + leftSize, 
                              inorder, inStart, index - 1, indexMap);

        root.right = buildTree(preorder, preStart + leftSize + 1, preEnd, 
                               inorder, index + 1, inEnd, indexMap);

        return root;
    }
}

