import com_github_leetcode.TreeNode;

public class Solution {
    public TreeNode buildTree(int[] inorder, int[] postorder) {
        return build(inorder, 0, inorder.length - 1, postorder, 0, postorder.length - 1);
    }

    private TreeNode build(int[] inorder, int inStart, int inEnd, int[] postorder, int postStart, int postEnd) {
        if (postStart > postEnd) return null;

        TreeNode root = new TreeNode(postorder[postEnd]);
        int index = findIndex(inorder, inStart, inEnd, postorder[postEnd]);

        int rightSize = inEnd - index;

        root.right = build(inorder, index + 1, inEnd, postorder, postEnd - rightSize, postEnd - 1);
        root.left = build(inorder, inStart, index - 1, postorder, postStart, postEnd - rightSize - 1);

        return root;
    }

    private int findIndex(int[] inorder, int start, int end, int target) {
        for (int i = start; i <= end; i++) {
            if (inorder[i] == target) return i;
        }
        throw new RuntimeException("Target not found in the array");
    }
}

