import java.util.*;

public class Solution {
    public List<List<String>> findLadders(String beginWord, String endWord, List<String> wordList) {
        Set<String> wordSet = new HashSet<>(wordList);
        if (!wordSet.contains(endWord)) return new ArrayList<>();

        Map<String, List<String>> graph = new HashMap<>();
        Queue<String> queue = new LinkedList<>();
        queue.offer(beginWord);

        boolean found = false;
        while (!queue.isEmpty()) {
            int size = queue.size();
            Set<String> currentLevel = new HashSet<>();
            for (int i = 0; i < size; i++) {
                String word = queue.poll();
                if (word.equals(endWord)) {
                    found = true;
                }
                List<String> neighbors = getNeighbors(word, wordSet);
                graph.putIfAbsent(word, new ArrayList<>());
                graph.get(word).addAll(neighbors);
                currentLevel.addAll(neighbors);
            }
            for (String word : currentLevel) {
                wordSet.remove(word);
            }
            if (found) break;
            queue.addAll(currentLevel);
        }

        List<List<String>> result = new ArrayList<>();
        dfs(beginWord, endWord, graph, new LinkedList<>(), result);
        return result;
    }

    private void dfs(String beginWord, String endWord, Map<String, List<String>> graph, Deque<String> path, List<List<String>> result) {
        path.offerLast(beginWord);
        if (beginWord.equals(endWord)) {
            result.add(new ArrayList<>(path));
            path.pollLast();
            return;
        }
        for (String neighbor : graph.getOrDefault(beginWord, new ArrayList<>())) {
            dfs(neighbor, endWord, graph, path, result);
        }
        path.pollLast();
    }

    private List<String> getNeighbors(String word, Set<String> wordSet) {
        List<String> neighbors = new ArrayList<>();
        char[] chars = word.toCharArray();
        for (int i = 0; i < chars.length; i++) {
            char originalChar = chars[i];
            for (char c = 'a'; c <= 'z'; c++) {
                if (c == originalChar) continue;
                chars[i] = c;
                String neighbor = new String(chars);
                if (wordSet.contains(neighbor)) neighbors.add(neighbor);
            }
            chars[i] = originalChar;
        }
        return neighbors;
    }
}

