import java.util.HashMap;
import java.util.Map;

public class Solution {
    public String fractionToDecimal(int numerator, int denominator) {
        if (numerator == 0) return "0";

        StringBuilder result = new StringBuilder();
        // Check for negative sign
        if ((numerator < 0) ^ (denominator < 0)) {
            result.append("-");
        }

        long num = Math.abs((long) numerator);
        long denom = Math.abs((long) denominator);

        // Calculate integer part
        result.append(num / denom);

        long remainder = num % denom;
        if (remainder == 0) return result.toString();

        result.append(".");

        Map<Long, Integer> map = new HashMap<>();
        StringBuilder decimalPart = new StringBuilder();

        while (remainder != 0 && !map.containsKey(remainder)) {
            map.put(remainder, decimalPart.length());
            remainder *= 10;
            decimalPart.append(remainder / denom);
            remainder %= denom;
        }

        if (remainder != 0) {
            int index = map.get(remainder);
            result.append(decimalPart.substring(0, index));
            result.append("(").append(decimalPart.substring(index)).append(")");
        } else {
            result.append(decimalPart.toString());
        }

        return result.toString();
    }
}

