import com_github_leetcode.random.Node;
import java.util.HashMap;

// Definition for a Node.
public class Solution {
    public Node copyRandomList(Node head) {
        if (head == null) return null;

        // Create a hashmap to store the mapping of original nodes to cloned nodes
        HashMap<Node, Node> map = new HashMap<>();

        // First pass: clone each node and store it in the hashmap
        Node current = head;
        while (current != null) {
            map.put(current, new Node(current.val));
            current = current.next;
        }

        // Second pass: set next and random pointers for cloned nodes
        current = head;
        while (current != null) {
            if (current.next != null) {
                map.get(current).next = map.get(current.next);
            }
            if (current.random != null) {
                map.get(current).random = map.get(current.random);
            }
            current = current.next;
        }

        // Return the head of the cloned list
        return map.get(head);
    }
}

