import java.util.Arrays;

public class Solution {
    public int makeArrayIncreasing(int[] arr1, int[] arr2) {
        Arrays.sort(arr2);
        return dfs(0, -1, arr1, arr2, new Integer[arr1.length][arr2.length + 1]);
    }

    private int dfs(int i, int prev, int[] arr1, int[] arr2, Integer[][] memo) {
        if (i == arr1.length) return 0;
        if (memo[i][prev + 1] != null) return memo[i][prev + 1];

        int res = Integer.MAX_VALUE;
        // try to keep the current element
        if (prev < arr1[i]) {
            res = dfs(i + 1, arr1[i], arr1, arr2, memo);
        }

        // try to replace the current element with elements from arr2
        int j = binarySearch(arr2, prev + 1);
        while (j < arr2.length && arr2[j] < arr1[i]) {
            res = Math.min(res, dfs(i + 1, arr2[j], arr1, arr2, memo) + 1);
            j++;
        }

        // if we cannot make the array increasing
        if (res == Integer.MAX_VALUE) return -1;

        memo[i][prev + 1] = res;
        return res;
    }

    private int binarySearch(int[] arr, int target) {
        int left = 0, right = arr.length - 1;
        while (left <= right) {
            int mid = left + (right - left) / 2;
            if (arr[mid] >= target) {
                right = mid - 1;
            } else {
                left = mid + 1;
            }
        }
        return left;
    }
}

