public class Solution {
    public int minHeightShelves(int[][] books, int shelfWidth) {
        int n = books.length;
        Integer[] memo = new Integer[n];

        return dp(0, books, shelfWidth, memo);
    }

    private int dp(int i, int[][] books, int shelfWidth, Integer[] memo) {
        if (i == books.length) {
            return 0;
        }
        if (memo[i] != null) {
            return memo[i];
        }

        int res = Integer.MAX_VALUE;
        int currWidth = 0;
        int currHeight = 0;

        for (int j = i; j < books.length; j++) {
            if (currWidth + books[j][0] > shelfWidth) {
                break;
            }
            currWidth += books[j][0];
            currHeight = Math.max(currHeight, books[j][1]);
            res = Math.min(res, currHeight + dp(j + 1, books, shelfWidth, memo));
