        for (char c : text.toCharArray()) {
            totalCountMap.put(c, totalCountMap.getOrDefault(c, 0) + 1);
        }

        List<Pair> charBlockCounts = new ArrayList<>();
        char prevChar = text.charAt(0);
        int count = 1;
        for (int i = 1; i < text.length(); i++) {
            if (text.charAt(i) == prevChar) {
                count++;
            } else {
                charBlockCounts.add(new Pair(prevChar, count));
                prevChar = text.charAt(i);
                count = 1;
            }
        }
        charBlockCounts.add(new Pair(prevChar, count));

        int maxLen = 0;
        // case 1: swap one item to the boundary of a consecutive character block
        for (int i = 0; i < charBlockCounts.size(); i++) {
            if (i > 0 && charBlockCounts.get(i).c == charBlockCounts.get(i - 1).c) {
                continue;
            }
            if (totalCountMap.get(charBlockCounts.get(i).c) > charBlockCounts.get(i).count) {
                maxLen = Math.max(maxLen, charBlockCounts.get(i).count + 1);
            }
        }

        // case 2: find xxxxYxxxxx pattern
        for (int i = 1; i < charBlockCounts.size() - 1; i++) {
            if (charBlockCounts.get(i).c != charBlockCounts.get(i - 1).c && charBlockCounts.get(i).c != charBlockCounts.get(i + 1).c) {
                if (totalCountMap.get(charBlockCounts.get(i - 1).c) > charBlockCounts.get(i - 1).count
                        || totalCountMap.get(charBlockCounts.get(i + 1).c) > charBlockCounts.get(i + 1).count) {
