public class Solution {
    public int maximumSum(int[] arr) {
        int n = arr.length;
        int[][] forward = new int[n][2];
        int[][] backward = new int[n][2];

        // Calculate the maximum sum for a subarray ending at each position without deletion
        forward[0][0] = arr[0];
        forward[0][1] = Integer.MIN_VALUE;

        for (int i = 1; i < n; i++) {
            forward[i][0] = Math.max(arr[i], forward[i - 1][0] + arr[i]);
            forward[i][1] = Integer.MIN_VALUE;
        }

        // Calculate the maximum sum for a subarray ending at each position with one deletion
        for (int i = 1; i < n; i++) {
            forward[i][1] = Math.max(forward[i - 1][0], forward[i - 1][1] + arr[i]);
        }

        // Calculate the maximum sum for a subarray starting at each position without deletion
        backward[n - 1][0] = arr[n - 1];
        backward[n - 1][1] = Integer.MIN_VALUE;

        for (int i = n - 2; i >= 0; i--) {
            backward[i][0] = Math.max(arr[i], backward[i + 1][0] + arr[i]);
            backward[i][1] = Integer.MIN_VALUE;
        }

        // Calculate the maximum sum for a subarray starting at each position with one deletion
        for (int i = n - 2; i >= 0; i--) {
            backward[i][1] = Math.max(backward[i + 1][0], backward[i + 1][1] + arr[i]);
        }

        // Calculate the maximum sum by considering all possible subarrays with at most one deletion
        int maxSum = Integer.MIN_VALUE;
        for (int i = 0; i < n; i++) {
            maxSum = Math.max(maxSum, forward[i][0]);
            maxSum = Math.max(maxSum, backward[i][0]);
            if (i > 0) {
                maxSum = Math.max(maxSum, forward[i - 1][0] + backward[i][0]);
            }
        }

        for (int i = 0; i < n; i++) {
            maxSum = Math.max(maxSum, forward[i][1]);
            maxSum = Math.max(maxSum, backward[i][1]);
        }

        return maxSum;
    }
}

