public class Solution {
    public List<TreeNode> delNodes(TreeNode root, int[] to_delete) {
        Set<Integer> set = new HashSet<>();
        for (int num : to_delete) {
            set.add(num);
        }

        List<TreeNode> res = new ArrayList<>();
        dfs(root, true, set, res);
        return res;
    }

    private TreeNode dfs(TreeNode node, boolean isRoot, Set<Integer> set, List<TreeNode> res) {
        if (node == null) {
            return null;
        }

        boolean shouldDelete = set.contains(node.val);
        if (isRoot && !shouldDelete) {
            res.add(node);
        }

        node.left = dfs(node.left, shouldDelete, set, res);
        node.right = dfs(node.right, shouldDelete, set, res);

        return shouldDelete ? null : node;
    }
}

