public class Solution {
    public int movesToMakeZigzag(int[] nums) {
        int n = nums.length;
        int res = Integer.MAX_VALUE;

        for (int k = 0; k < 2; k++) {
            int count = 0;
            for (int i = 0; i < n; i++) {
                if ((i + k) % 2 == 0) {
                    int max = 0;
                    if (i > 0) {
                        max = Math.max(max, nums[i - 1]);
                    }
                    if (i < n - 1) {
                        max = Math.max(max, nums[i + 1]);
                    }
                    if (nums[i] <= max) {
                        count += max - nums[i] + 1;
                    }
                }
            }
            res = Math.min(res, count);
        }

        return res;
    }
}

