import java.util.Arrays;
public class Solution {
    public int stoneGameII(int[] piles) {
        int n = piles.length;
        int[][] memo = new int[n][n + 1];
        for (int i = 0; i < n; i++) {
            Arrays.fill(memo[i], -1);
        }

        int suffixSum[] = new int[n];
        suffixSum[n - 1] = piles[n - 1];
        for (int i = n - 2; i >= 0; i--) {
            suffixSum[i] = suffixSum[i + 1] + piles[i];
        }

        return dfs(0, 1, memo, suffixSum);
    }

    private int dfs(int index, int m, int[][] memo, int[] suffixSum) {
        if (index == suffixSum.length) {
            return 0;
        }

        if (memo[index][m] != -1) {
            return memo[index][m];
        }

        int maxScore = Integer.MIN_VALUE;
        for (int x = 1; x <= 2 * m; x++) {
            if (index + x > suffixSum.length) {
                break;
            }

            int score = suffixSum[index] - dfs(index + x, Math.max(m, x), memo, suffixSum);
            maxScore = Math.max(maxScore, score);
        }

        return memo[index][m] = maxScore;
    }
}

