import java.util.*;

public class Solution {
    public int[] smallestSufficientTeam(String[] req_skills, List<List<String>> people) {
        Map<String, Integer> skillToIndex = new HashMap<>();
        for (int i = 0; i < req_skills.length; i++) {
            skillToIndex.put(req_skills[i], i);
        }

        int n = req_skills.length;
        int[] dp = new int[1 << n];
        Arrays.fill(dp, Integer.MAX_VALUE);

        Map<Integer, List<Integer>> map = new HashMap<>();
        for (int i = 0; i < people.size(); i++) {
            int mask = 0;
            for (String skill : people.get(i)) {
                if (skillToIndex.containsKey(skill)) {
                    mask |= 1 << skillToIndex.get(skill);
                }
            }
            map.put(mask, new ArrayList<>(Arrays.asList(i)));
        }

        dp[0] = -1;

        for (int i = 1; i < (1 << n); i++) {
            if (!map.containsKey(i)) continue;
            dp[i] = map.get(i).size();
            for (int j = i; j > 0; j = (j - 1) & i) {
                if (dp[j] != Integer.MAX_VALUE && dp[i ^ j] + map.get(j).size() < dp[i]) {
                    dp[i] = dp[i ^ j] + map.get(j).size();
                    List<Integer> list = new ArrayList<>(map.get(i ^ j));
                    list.addAll(map.get(j));
                    map.put(i, list);
                }
            }
        }

        return map.get((1 << n) - 1).stream().mapToInt(Integer::intValue).toArray();
    }
}

