import java.util.logging.Logger;

public class Solution {
    public boolean parseBoolExpr(String expression) {
        Stack<Boolean> stack = new Stack<>();

        for (char c : expression.toCharArray()) {
            if (c == ',') continue;
            if (c == 't' || c == 'f') {
                stack.push(c == 't');
            } else if (c == '!') {
                boolean val = stack.pop();
                stack.push(!val);
            } else if (c == '&') {
                List<Boolean> list = new ArrayList<>();
                while (!stack.isEmpty() && !(stack.peek() instanceof Boolean)) {
                    list.add(stack.pop());
                }
                for (boolean b : list) {
                    if (!b) {
                        stack.push(false);
                        break;
                    }
                }
                if (list.isEmpty()) {
                    stack.push(true);
                }
            } else if (c == '|') {
                List<Boolean> list = new ArrayList<>();
                while (!stack.isEmpty() && !(stack.peek() instanceof Boolean)) {
                    list.add(stack.pop());
                }
                for (boolean b : list) {
                    if (b) {
                        stack.push(true);
                        break;
                    }
                }
                if (list.isEmpty()) {
                    stack.push(false);
                }
            } else if (c == ')') {
                List<Boolean> list = new ArrayList<>();
                while (!stack.isEmpty() && !(stack.peek() instanceof Boolean)) {
                    list.add(stack.pop());
                }
                boolean result = true;
                for (boolean b : list) {
                    result &= b;
                }
                stack.push(result);
            } else if (c == '(') {
                continue;
            }
        }

        return stack.pop();
    }
}

