        if (node == null) return;

        if (level > levelSums.size()) {
            levelSums.add(node.val);
        } else {
            int currentSum = levelSums.get(level - 1);
            levelSums.set(level - 1, currentSum + node.val);
        }

        dfs(node.left, level + 1, levelSums);
        dfs(node.right, level + 1, levelSums);
    }
}

