public class Solution {
    public String lastSubstring(String s) {
        int n = s.length();
        char[] chars = s.toCharArray();
        int maxStart = 0;

        for (int i = 1; i < n; i++) {
            if (chars[i] > chars[maxStart]) {
                maxStart = i;
            } else if (chars[i] == chars[maxStart]) {
                int j = i + 1, k = maxStart + 1;
                while (j < n && k < n) {
                    if (chars[j] > chars[k]) {
                        maxStart = i;
                        break;
                    } else if (chars[j] < chars[k]) {
                        break;
                    }
                    j++;
