public class Solution {
    public int numPrimeArrangements(int n) {
        boolean[] isPrime = new boolean[n + 1];
        for (int i = 0; i <= n; i++) {
            isPrime[i] = true;
        }
        isPrime[0] = false;
        isPrime[1] = false;

        // Use the Sieve of Eratosthenes algorithm to mark non-prime numbers
        for (int i = 2; i * i <= n; i++) {
            if (isPrime[i]) {
                for (int j = i * i; j <= n; j += i) {
                    isPrime[j] = false;
                }
            }
        }

        int primeCount = 0, nonPrimeCount = 0;
        for (int i = 1; i <= n; i++) {
            if (isPrime[i]) {
                primeCount++;
            } else {
                nonPrimeCount++;
            }
        }

        long result = factorial(primeCount) * factorial(nonPrimeCount);
        return (int) (result % (1000000007));
    }

    private long factorial(int n) {
        long result = 1;
        for (int i = 2; i <= n; i++) {
            result = (result * i) % (1000000007);
        }
        return result;
    }
}

