import java.util.LinkedList;
import java.util.List;

public class Solution {
    public List<Integer> pathInZigZagTree(int label) {
        List<Integer> result = new LinkedList<>();
        int level = 0;
        while ((1 << level) <= label) {
            level++;
        }
        level--;

        while (level >= 0) {
            if (level % 2 == 0) {
                result.add(0, label);
            } else {
                int nodesInLevel = 1 << level;
                int maxLabel = (1 << (level + 1)) - 1;
                int minLabel = (1 << level);
                int expectedLabel = maxLabel - (label - minLabel);
                result.add(0, expectedLabel);
            }
            label /= 2;
            level--;
        }

        return result;
    }
}

