public class Solution {
    public int[] relativeSortArray(int[] arr1, int[] arr2) {
        Map<Integer, Integer> countMap = new HashMap<>();

        // Count occurrences of each number in arr1
        for (int num : arr1) {
            countMap.put(num, countMap.getOrDefault(num, 0) + 1);
        }

        int[] result = new int[arr1.length];
        int index = 0;

        // First, add elements that appear in arr2 to the result array
        for (int num : arr2) {
            if (countMap.containsKey(num)) {
                while (countMap.get(num) > 0) {
                    result[index++] = num;
                    countMap.put(num, countMap.get(num) - 1);
                }
            }
        }

        // Then, add elements that do not appear in arr2 to the result array
        for (int num : countMap.keySet()) {
            if (!isInArray(arr2, num)) {
                while (countMap.get(num) > 0) {
                    result[index++] = num;
                    countMap.put(num, countMap.get(num) - 1);
                }
            }
        }

        // Sort the elements that do not appear in arr2
        int[] temp = new int[arr1.length];
        index = 0;
        for (int num : countMap.keySet()) {
            if (!isInArray(arr2, num)) {
                while (countMap.get(num) > 0) {
                    temp[index++] = num;
                    countMap.put(num, countMap.get(num) - 1);
                }
            }
        }

        Arrays.sort(temp, 0, index);
        System.arraycopy(temp, 0, result, getFirstUnusedIndex(arr2, result), index);

        return result;
    }

    private boolean isInArray(int[] arr, int target) {
        for (int num : arr) {
            if (num == target) {
                return true;
            }
        }
        return false;
    }

    private int getFirstUnusedIndex(int[] arr2, int[] result) {
        int index = 0;
        for (int num : arr2) {
            while (index < result.length && result[index] != 0) {
                index++;
            }
            if (index >= result.length) {
                break;
            }
            result[index++] = num;
        }
        return index;
    }
}

