public class Solution {
    public int largest1BorderedSquare(int[][] grid) {
        int rows = grid.length;
        if (rows == 0) return 0;
        int cols = grid[0].length;

        int maxSide = Math.min(rows, cols);
        for (int side = maxSide; side > 0; side--) {
            for (int i = 0; i <= rows - side; i++) {
                for (int j = 0; j <= cols - side; j++) {
                    if (isBordered(grid, i, j, side)) {
                        return side * side;
                    }
                }
            }
        }

        return 0;
    }

    private boolean isBordered(int[][] grid, int row, int col, int side) {
        for (int i = row; i < row + side; i++) {
            if (grid[i][col] != 1 || grid[i][col + side - 1] != 1) {
                return false;
            }
        }

        for (int j = col; j < col + side; j++) {
            if (grid[row][j] != 1 || grid[row + side - 1][j] != 1) {
                return false;
            }
        }

        return true;
    }
}

