public class Solution {
    public int[] shortestAlternatingPaths(int n, int[][] redEdges, int[][] blueEdges) {
        List<int[]>[] graph = new ArrayList[n];
        for (int i = 0; i < n; i++) {
            graph[i] = new ArrayList<>();
        }

        // Build the graph
        for (int[] edge : redEdges) {
            graph[edge[0]].add(new int[]{edge[1], 0});
        }
        for (int[] edge : blueEdges) {
            graph[edge[0]].add(new int[]{edge[1], 1});
        }

        // Initialize the result array
        int[] res = new int[n];
        Arrays.fill(res, -1);

        // BFS from node 0
        Queue<int[]> queue = new LinkedList<>();
        boolean[][] visited = new boolean[n][2];
        queue.offer(new int[]{0, 0, -1}); // node, distance, previous color
        res[0] = 0;

        while (!queue.isEmpty()) {
            int[] curr = queue.poll();
            int node = curr[0], dist = curr[1], prevColor = curr[2];

            for (int[] neighbor : graph[node]) {
                int nextNode = neighbor[0];
                int color = neighbor[1];

                if ((prevColor == -1 || color != prevColor) && !visited[nextNode][color]) {
                    visited[nextNode][color] = true;
                    queue.offer(new int[]{nextNode, dist + 1, color});
                    if (res[nextNode] == -1 || res[nextNode] > dist + 1) {
                        res[nextNode] = dist + 1;
                    }
                }
            }
        }

        return res;
    }
}

