import java.util.Arrays;

public class Solution {
    public int[] numSmallerByFrequency(String[] queries, String[] words) {
        int[] answer = new int[queries.length];

        // Calculate the frequency of lexicographically smallest character for each word
        int[] wordFrequencies = new int[words.length];
        for (int i = 0; i < words.length; i++) {
            wordFrequencies[i] = getFrequency(words[i]);
        }

        Arrays.sort(wordFrequencies);

        // For each query, count the number of words with higher frequency
        for (int i = 0; i < queries.length; i++) {
            int queryFrequency = getFrequency(queries[i]);
            answer[i] = binarySearch(wordFrequencies, queryFrequency);
        }

        return answer;
    }

    private int getFrequency(String s) {
        char smallestChar = 'z';
        for (char c : s.toCharArray()) {
            if (c < smallestChar) {
                smallestChar = c;
            }
        }

        int frequency = 0;
        for (char c : s.toCharArray()) {
            if (c == smallestChar) {
                frequency++;
            }
        }

        return frequency;
    }

    private int binarySearch(int[] arr, int target) {
        int left = 0;
        int right = arr.length - 1;

        while (left <= right) {
            int mid = left + (right - left) / 2;

            if (arr[mid] > target) {
                right = mid - 1;
            } else {
                left = mid + 1;
            }
        }

        return arr.length - left;
    }
}

