// #2022_03_03_Time_127_ms_(89.39%)_Space_262.1_MB_(59.13%)
public class Solution {
    public List<List<Integer>> criticalConnections(int n, int[][] connections) {
        // build graph
        Map<Integer, List<Integer>> graph = new HashMap<>();
        for (int[] connection : connections) {
            int a = connection[0];
            int b = connection[1];
            graph.computeIfAbsent(a, k -> new ArrayList<>()).add(b);
            graph.computeIfAbsent(b, k -> new ArrayList<>()).add(a);
        }

        // record rank
        int[] rank = new int[n];
        Arrays.fill(rank, -1);

        List<List<Integer>> result = new ArrayList<>();
        dfs(graph, 0, -1, rank, result, connections);
        return result;
    }

    private void dfs(Map<Integer, List<Integer>> graph, int node, int parent, int[] rank, List<List<Integer>> result, int[][] connections) {
        if (rank[node] != -1) {
            return;
        }
        rank[node] = graph.size();
        for (int nei : graph.get(node)) {
            // skip the parent
            if (nei == parent) {
                continue;
            }

            dfs(graph, nei, node, rank, result, connections);
            rank[node] = Math.min(rank[node], rank[nei]);

            // check if connection between node and nei is critical
            for (int[] connection : connections) {
                int a = connection[0];
                int b = connection[1];
                if ((a == node && b == nei) || (b == node && a == nei)) {
                    if (rank[nei] > rank[node]) {
                        result.add(Arrays.asList(a, b));
                    }
                }
            }
        }
    }
}

