public class Solution {
    private static final int MOD = (int) 1e9 + 7;

    public int minNonZeroProduct(int p) {
        long x = (long) Math.pow(2, p) - 1;
        long y = x / 2;

        long res = powMod(x - 1, y);
        return (int) ((res * x) % MOD);
    }

    private long powMod(long a, long b) {
        long res = 1;
        while (b > 0) {
            if ((b & 1) == 1) {
                res = (res * a) % MOD;
            }
            a = (a * a) % MOD;
            b >>= 1;
        }
        return res;
    }
}

