            int index = 0;
            for (int j = 0; j < sums.length; j++) {
                if (!used[j]) {
                    subsetSums[index++] = sums[j];
                    used[j] = true;
                    int diff = maxSum - sums[j];
                    for (int k = j + 1; k < sums.length; k++) {
                        if (!used[k] && sums[k] == diff) {
                            used[k] = true;
                            break;
                        }
                    }
                }
            }
            subsetSums = Arrays.copyOfRange(subsetSums, 0, index);
            int[] tempAns = new int[n];
            for (int j = 1; j < subsetSums.length / 2 + 1; j++) {
                if ((subsetSums[j] - subsetSums[0]) == (subsetSums[subsetSums.length - j] - subsetSums[subsetSums.length - 1])) {
                    tempAns[i] = subsetSums[j] - subsetSums[0];
                    break;
                }
            }
            ans[i] = tempAns[i];
        }
        return ans;
    }
}

