public class Solution {
    private static final int MOD = (int) 1e9 + 7;

    public int numberOfUniqueGoodSubsequences(String binary) {
        long hasZero = 0, hasOne = 0;

        for (char c : binary.toCharArray()) {
            if (c == '0') {
                hasZero = (hasZero + hasOne + 1) % MOD;
            } else {
                hasOne = (hasOne + hasZero) % MOD;
            }
        }

        int count = (int) ((hasOne + hasZero) % MOD);

        // Add "0" if it exists in the binary string
        for (char c : binary.toCharArray()) {
            if (c == '0') {
                return (count + 1) % MOD;
            }
        }

        return count;
    }
}

