// #Medium #Array #Heap_Priority_Queue #2022_05_20_Time_761_ms_(48.67%)_Space_124.8_MB_(24.78%)
import java.util.Collections;
import java.util.PriorityQueue;

public class Solution {
    public int minStoneSum(int[] piles, int k) {
        PriorityQueue<Integer> maxHeap = new PriorityQueue<>(Collections.reverseOrder());

        // Add all pile sizes to the max heap
        for (int size : piles) {
            maxHeap.offer(size);
        }

        // Apply the operation k times
        for (int i = 0; i < k; i++) {
            int currentSize = maxHeap.poll();
            int newSize = currentSize - (currentSize / 2);
            maxHeap.offer(newSize);
        }

        // Calculate the total number of stones remaining
        int totalStones = 0;
        while (!maxHeap.isEmpty()) {
            totalStones += maxHeap.poll();
        }

        return totalStones;
    }
}

