public class Solution {
    public int[][] rotateGrid(int[][] grid, int k) {
        int m = grid.length;
        int n = grid[0].length;

        for (int layer = 0; layer < Math.min(m, n) / 2; layer++) {
            int[] temp = new int[(m - 2 * layer) * 2 + (n - 2 * layer) * 2 - 4];
            int index = 0;

            // Extract the current layer into a temporary array
            for (int i = layer; i < m - layer; i++) {
                temp[index++] = grid[i][layer];
            }
            for (int j = layer + 1; j < n - layer; j++) {
                temp[index++] = grid[m - layer - 1][j];
            }
            for (int i = m - layer - 2; i >= layer; i--) {
                temp[index++] = grid[i][n - layer - 1];
            }
            for (int j = n - layer - 2; j > layer; j--) {
                temp[index++] = grid[layer][j];
            }

            // Rotate the temporary array
            k %= temp.length;
            int[] rotatedTemp = new int[temp.length];
            System.arraycopy(temp, k, rotatedTemp, 0, temp.length - k);
            System.arraycopy(temp, 0, rotatedTemp, temp.length - k, k);

            // Put the rotated layer back into the grid
            index = 0;
            for (int i = layer; i < m - layer; i++) {
                grid[i][layer] = rotatedTemp[index++];
            }
            for (int j = layer + 1; j < n - layer; j++) {
                grid[m - layer - 1][j] = rotatedTemp[index++];
            }
            for (int i = m - layer - 2; i >= layer; i--) {
                grid[i][n - layer - 1] = rotatedTemp[index++];
            }
            for (int j = n - layer - 2; j > layer; j--) {
                grid[layer][j] = rotatedTemp[index++];
            }
        }

        return grid;
    }
}

