import java.util.Arrays;
public class Solution {
    public int maxCompatibilitySum(int[][] students, int[][] mentors) {
        int n = students[0].length;
        int m = students.length;
        return dfs(0, new boolean[m], students, mentors, 0, n);
    }

    private int dfs(int index, boolean[] used, int[][] students, int[][] mentors, int score, int n) {
        if (index == students.length) {
            return score;
        }
        int maxScore = Integer.MIN_VALUE;
        for (int i = 0; i < mentors.length; i++) {
            if (!used[i]) {
                used[i] = true;
                int currentScore = getCompatibilityScore(students[index], mentors[i]);
                maxScore = Math.max(maxScore, dfs(index + 1, used, students, mentors, score + currentScore, n));
                used[i] = false;
            }
        }
        return maxScore;
    }

    private int getCompatibilityScore(int[] student, int[] mentor) {
        int score = 0;
        for (int i = 0; i < student.length; i++) {
            if (student[i] == mentor[i]) {
                score++;
            }
        }
        return score;
    }
}

