public class Solution {
    public int[] findPeakGrid(int[][] mat) {
        int m = mat.length;
        int n = mat[0].length;

        int left = 0, right = n - 1;
        while (left <= right) {
            int midCol = left + (right - left) / 2;

            // Find the maximum element in the current column
            int maxRow = 0;
            for (int row = 1; row < m; row++) {
                if (mat[row][midCol] > mat[maxRow][midCol]) {
                    maxRow = row;
                }
            }

            // Check if the maximum element is a peak
            boolean isPeak = true;
            int[][] directions = {{-1, 0}, {1, 0}, {0, -1}, {0, 1}};
            for (int[] direction : directions) {
                int newRow = maxRow + direction[0];
                int newCol = midCol + direction[1];
                if (newRow >= 0 && newRow < m && newCol >= 0 && newCol < n && mat[newRow][newCol] > mat[maxRow][midCol]) {
                    isPeak = false;
                    break;
                }
            }

            // If the maximum element is a peak, return its position
            if (isPeak) {
                return new int[] {maxRow, midCol};
            }

            // Otherwise, move to the left or right half of the matrix
            if (midCol > 0 && mat[maxRow][midCol - 1] > mat[maxRow][midCol]) {
                right = midCol - 1;
            } else {
                left = midCol + 1;
            }
        }

        // If no peak is found, return an empty array
        return new int[] {};
    }
}

